(27, 'Nokia 3310', '', 'Le nouveau Nokia 3310 emprunte la silhouette emblématique de l’original et la réinvente pour 2017. L\'interface utilisateur conçue sur mesure renouvelle totalement ce grand classique. Son écran polarisé et incurvé de 2,4 pouces facilite la lecture en plein soleil. Il est plus mince et plus léger que l’original, mais reste immédiatement reconnaissable grâce...', 750, 'https://www.boutika.co.ma/29002-home_default/nokia-3310.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10584-nokia-3310.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 13),
