(398, 'RUSSELL HOBBS Slice and Go Desire', '', 'La combinaison de forme et de fonction, en acier inoxydable, dispose d\'un design élégant et contemporain.Facile à utiliser et facile à nettoyer, il prend tout le travail de préparation des aliments et a toutes les caractéristiques pour habilement trancher et déchiqueter les légumes. Garantie fabricant : 1 an', 349, 'https://www.boutika.co.ma/25946-home_default/russell-hobbs-slice-and-go-desire.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/9631-russell-hobbs-slice-and-go-desire.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 23),
