(402, 'FAGOR SP-1235 Sèche Cheveux Voyage', '', 'FAGORSP-1235 Sèche Cheveux Voyage Sécher rapidement vos cheveux à la sortie de la douche avec le sèche-cheveux SP-1235 de FAGOR .Puissance: 1200 W Avec son manche pliable il occupe un minimum d\'espace Son sélecteur 2 puissances 2 vitesses permet de réguler la chaleur selon le type de cheveux. Toujours à portée de main grace à son anneau de suspension.', 280, 'https://www.boutika.co.ma/9319-home_default/fagor-seche-cheveux-voyage.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3879-fagor-seche-cheveux-voyage.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 23),
(403, 'AEG Rasoir de Poche', '', 'Le rasoir de poche de AEG saura vous séduire par ses performances et son design moderne et élégant. Tête de rasage amovible, utilisation sans fil, indicateur de charge, ... tout a été pensé pour prendre soin de votre apparence dans un petit format !Rechargeable Tête de rasage amovible Format compact', 379, 'https://www.boutika.co.ma/26132-home_default/aeg-rasoir-de-poche.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/9717-aeg-rasoir-de-poche.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 23),
(404, 'FAGOR SP 2505 Sèche Cheveux Professionnel', '', 'FAGOR SP-2505 Sèche Cheveux Professionnel D\'une puissance de 2500W, cet appareil possède un design élégant. Le modèle SP-2505 dispose de 3 combinaisons température/vitesse. Avec son concentrateur d\'air, vous offrez à vos cheveux un séchage précis et leur donnez un aspect parfaitement lissé', 570, 'https://www.boutika.co.ma/9324-home_default/fagor-seche-cheveux-professionnel.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3880-fagor-seche-cheveux-professionnel.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 23),
