(666, 'World of Warcraft Warlords of Draenor Pc-Clé', '', 'Au cœur des jungles inhospitalières et dans les plaines ravagées par la guerre de Draenor, les puissants clans orcs de jadis se sont alliés en une nouvelle et impitoyable Horde de Fer. Afin d’endiguer une invasion imminente, les héros d’Azeroth devront explorer les confins de ces terres implacables, se hisser à des sommets de puissance au cours de leur...', 390, 'https://www.boutika.co.ma/21441-home_default/world-of-warcraft-warlords-of-draenor.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7908-world-of-warcraft-warlords-of-draenor.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 28),
