(680, 'DEAD RISING 3 - XBOX ONE', '', 'Dead Rising 3 est un jeu d\'action sur Xbox One. Cette fois, l\'histoire se déroule à Los Perdidos qui, d\'ici quelques jours, va être rasée par une frappe nucléaire afin d\'enrayer la menace zombie. Il va donc vous falloir trouver un moyen de quitter ladite ville à temps tout en repoussant les assauts de milliers de morts-vivants et autres psychopathes.', 590, 'https://www.boutika.co.ma/10509-home_default/dead-rising-3-xbox-one.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4226-dead-rising-3-xbox-one.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 28);
