(681, 'Thief Pc-Clé', '', 'De retour sur PC, découvrez le quatrième volet de la série d\'action/infiltration Thief. Vous incarnez le célèbre et talentueux voleur Garrett. Dans cet épisode, la discrétion et la ruse sont toujours de mise tout comme l\'habileté du héros. A pas de velours, venez dérober les objets les mieux gardés qu\'il soit.', 125, 'https://www.boutika.co.ma/12941-home_default/-thief-pc.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/5364--thief-pc.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 28),
(682, 'Playstation Plus Abonnement', '', 'Playstation Plus Abonnements de 3 Mois et 12 Mois. Carte d\'abonnement au Playstation Plus, compatibles PS4 et PS3 au Maroc Votre code d\'abonnement vous sera envoyé par email, quelques minutes seulement aprés la validation de votre commande. Ainsi vous purrez profiter tout de suite des jeux enligne et des avantages de l\'abonnement au Playstation Plus sur...', 330, 'https://www.boutika.co.ma/21884-home_default/playstation-plus-abonnement-maroc.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3004-playstation-plus-abonnement-maroc.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 28),
(683, 'TOMB RAIDER - XBOX ONE', '', 'Tomb Raider est un jeu d\'action-aventure sur Xbox One. On y incarne la jeune Lara, âgée de 21 ans, qui va devoir survivre sur une île à la suite d\'un naufrage. Pour ce faire, elle devra se nourrir, chasser mais aussi faire attention aux menaces qui planent sur elle.', 800, 'https://www.boutika.co.ma/11239-home_default/tomb-raider-xbox-one.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4568-tomb-raider-xbox-one.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 28),
(684, 'Pro Evolution Soccer 2016 Pc-Clé', '', 'Précommander : Pro Evolution Soccer 2016 - Screenshot éditeurDe là à parler du \"retour du roi™\" comme à chaque saison, il reste encore un peu de marge, hélas (ou tant mieux). Ce n’est pas une simple question de licences à la rue, de transferts pas à jour au lancement, de faciès dégueulasses sortis du gotha mondial et de modes de jeu simplistes. Comparé à...', 392, 'https://www.boutika.co.ma/21487-home_default/pro-evolution-soccer-2016.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7935-pro-evolution-soccer-2016.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 28),
(685, 'KILLZONE Shadow fall', '', 'Killzone : Shadow Fall est un FPS exclusif à la PS4. Les événements de cet épisode se déroulent 30 ans après le précédent opus. On y incarne un shadow marshall chargé de maintenir la paix précaire entre les Vektans et les Helghasts. Vous disposez d\'un drone capable de vous seconder au combat et qui vous offre un large choix d\'opportunités tactiques sur le...', 800, 'https://www.boutika.co.ma/10503-home_default/killzone-shadow-fall.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4225-killzone-shadow-fall.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 28),
(686, 'Thief - XBOX-ONE', '', 'Thief est un jeu d\'infiltration sur Xbox One. Incarnez Garrett, le roi des voleurs entraîné malgré lui dans un complot susceptible de détruire la Cité. En utilisant vos talents pour l\'infiltration et les gadgets de Garrett, faufilez-vous au sein d’environnements variés et mettez un terme à la menace qui pèse sur la ville.', 450, 'https://www.boutika.co.ma/11257-home_default/thief-xbox-one.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4574-thief-xbox-one.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 28),
