(692, 'Manette sans fil Xbox One', '', 'Élevez votre jeu Découvrez l\'intensité, la précision et le confort uniques de la manette sans fil Xbox One. Les gâchettes à impulsions offrent un retour de vibrations afin que vous puissiez ressentir chaque choc et secousse en haute définition. Des sticks réactifs et une croix directionnelle améliorée garantissent une précision décuplée. Prise jack...', 750, 'https://www.boutika.co.ma/7585-home_default/manette-sans-fil-pour-xbox-one.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3150-manette-sans-fil-pour-xbox-one.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 29),
