(712, 'LIGHT BLUE de D&G Pour Femme', '', 'LIGHT BLUE Dreaming in Portofino (Eau de Toilette) de Dolce & Gabbana Pour Femme Ce parfum est un bouquet de fraîcheur avec le litchi et le grain d\'ambrette, il développe uncœur floral riche avec l\'iris vaporeux et l\'intensité de l\'osmanthus. Les notes d\'ambre, de patchouli et de musc le perfectionnent enlaissant derrière comme une traîne de dentelle', 689, 'https://www.boutika.co.ma/7851-home_default/dg-light-blue-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/705-dg-light-blue-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
