(719, 'LANVIN Marry me !', '', 'LANVIN Marry me ! 75 ml (Eau de Parfum) pour femme Marry me ! Comme une évidence, un caprice ou un défi. Le parfum d\'une rencontre, passion des premiers jours, promesse d\'une histoire d\'amour', 725, 'https://www.boutika.co.ma/29251-home_default/lanvin-marry-me-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10678-lanvin-marry-me-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(720, 'LA VIE EST BELLE de Lancôme Pour Femme', '', 'Parfum LA VIE EST BELLE (Eau de Parfum)de Lancôme Pour Femme La vie est belle symbolise la femme libre, une nouvelle philosophie de vie. Loin des contraintes, loin des diktats, chaque femme veut choisir son propre chemin vers le bonheur. Faire le choix d’être soi-même, de vivre pleinement une féminité consentie', 655, 'https://www.boutika.co.ma/1549-home_default/la-vie-est-belle-de-lancome.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/754-la-vie-est-belle-de-lancome.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(721, 'LANCÔME Trésor in Love', '', 'LANCÔME Trésor in Love 30ml (Eau de Parfum) pour femme Vingt ans après la création de Trésor, Lancôme lève le voile sur Trésor in Love et écrit une nouvelle histoire : cet instant précieux où tout commence, un élan de romantisme dans un bouquet de notes florales. Tour à tour lumineux et vibrant, sensuel et rayonnant, Trésor in Love est un hymne à l\'amour...', 615, 'https://www.boutika.co.ma/29176-home_default/lancome-tresor-in-love.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10640-lancome-tresor-in-love.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(722, 'LANCÔME La Nuit Trésor', '', 'LANCÔME La Nuit Trésor 100 ml (Eau de Parfum) pour femme La Nuit Trésor est née d’une fascinante énigme : deux étoiles irrémédiablement attirées l’une vers l’autre entrant en collision pour former, au fil du temps, un diamant noir.', 1088, 'https://www.boutika.co.ma/29337-home_default/lancome-la-nuit-tresor.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10708-lancome-la-nuit-tresor.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(723, 'LANCÔME Trésor', '', 'LANCÔME Trésor 50ml (Eau de Parfum) pour femme L\'amour est un trésor. Depuis sa création en 1990, Trésor incarne l\'amour absolu sous toutes ses facettes.Une fragrance subtile et légère qu\'enveloppe un voile doux et romantique. Partagez l\'émotion de l\'amour éternel avec Trésor, le parfum des instants précieux', 805, 'https://www.boutika.co.ma/29177-home_default/lancome-tresor.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10641-lancome-tresor.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(724, 'Lancôme Trésor Midnight Rose pour Femme', '', 'Trésor Midnight Rose deLancôme 50 ml (Eau de Parfum) Pour Femme Trésor Midnight Rose, une fragrance gourmande comme une « rose d’amour ».Le sillage fruité d’un nectar magique aux reflets pourpres', 719, 'https://www.boutika.co.ma/18302-home_default/lancome-tresor-midnight-rose-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6811-lancome-tresor-midnight-rose-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(725, 'GUERLAIN Mon Guerlain', '', 'GUERLAIN Mon Guerlain (Eau de Parfum) pour femme Mon tatouage invisible, mon parfum, Mon Guerlain.Mon Guerlain est le nouveau parfum de la Maison, un hommage à la féminité d’aujourd’hui :une féminité forte, libre et sensuelle', 667, 'https://www.boutika.co.ma/29358-home_default/guerlain-mon-guerlain.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10715-guerlain-mon-guerlain.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(726, 'Guerlain LA PETITE ROBE NOIRE', '', 'LA PETITE ROBE NOIRE de Guerlain (Eau de Parfum) Pour Femmes Une création parfumée absolument indispensable et totalement irrésistible. Le flacon mythique “cœur inversé” est revisité avec audace et modernité. Dans sa transparence cristalline, dégradée du noir au rose poudré, se dévoile en ombre chinoise la silhouette de la petite robe noire, prête à danser !', 830, 'https://www.boutika.co.ma/7486-home_default/la-petite-robe-noire-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3112-la-petite-robe-noire-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(727, 'GUERLAIN La Petite Robe Noire Couture', '', 'La Petite Robe Noire Couture de Guerlain 50ml (Eau de Parfum) Pour Femme Je suis absolument indispensable et totalement irrésistible,chic et terriblement glamour.L\'Eau de Parfum Couture, est une sublime robe longue cousue de notes florales fraîches et surpiquée de notes boisées ultra raffinées', 810, 'https://www.boutika.co.ma/15903-home_default/guerlain-la-petite-robe-noire-couture.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6142-guerlain-la-petite-robe-noire-couture.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(728, 'L\'INSTANT DE GUERLAIN edp', '', 'L\'Instant de Guerlain (Eau de Parfum) pour femme L\'Eau de Parfum est une version contemporaine, ensoleillée et lumineuse de la Guerlinade.Il diffuse des notes de musc blanc aussi douces que le cachemire et la soie pour un sentiment de féminité absolue', 865, 'https://www.boutika.co.ma/29206-home_default/l-instant-de-guerlain-edp.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10656-l-instant-de-guerlain-edp.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(729, 'GUERLAIN Shalimar Parfum Initial EdP Femme', '', 'Shalimar Parfum Initial de Guerlain 60ml (Eau de Parfum) Pour Femme Une initiation à la volupté, à la sensualité, une initiation à Shalimar.C\'est le moment où tout commence, comme la fraîcheur des premières fois, comme le trouble d\'une émotion nouvelle.Une écriture lumineuse aux notes florales ambrées', 775, 'https://www.boutika.co.ma/8579-home_default/shalimar-parfum-initial-edp-guerlain.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3550-shalimar-parfum-initial-edp-guerlain.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(730, 'GUERLAIN SHALIMAR EdT Femme', '', 'SHALIMAR de Guerlain 50ml (Eau de Toilette) Pour Femme Inspiré par l\'histoire d\'un amour fou entre un empereur et une princesse indienne, Shalimar, qui signifie en sanscrit \"Temple de l\'amour\", symbolise à jamais l\'essence du désir, la promesse d\'un amour éternel.', 710, 'https://www.boutika.co.ma/8583-home_default/shalimar-edt-guerlain-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3552-shalimar-edt-guerlain-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(731, 'GUERLAIN IDYLLE pour Femme', '', 'IDYLLE de Guerlain 100 ml(Eau de Toilette) pour FemmeCe nouvel opus est plus exubérant, plus \"néroli-freesia\", mais aussi plus extraverti, plus \"montant\" et plus frais, comme déshabillé de sa robe d\'apparat. Presque nu, le parfum s\'enroule dans ces muscs à odeur de peau plus légers que plumes, le chypre est enlacé par un ylang-ylang plus délicat que...', 880, 'https://www.boutika.co.ma/7898-home_default/guerlaine-idylle.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3281-guerlaine-idylle.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(732, 'GUERLAIN Idylle Eau Sublime Femme', '', 'Idylle Eau Sublime de Guerlain 70 ml (Eau de Toilette) Pour Femme Une orchestration des matières premières les plus nobles et les plus pures en une composition sublime, aussi précieuse qu\'une goutte de cristal.La signature florale-chyprée de Idylle est ré-orchestrée pour dévoiler une facette florale-fruitée renforcée. Au coeur du bouquet, certaines fleurs...', 888, 'https://www.boutika.co.ma/8722-home_default/idylle-eau-sublime-guerlain-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3625-idylle-eau-sublime-guerlain-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(733, 'GUERLAIN Santal Royal', '', 'GUERLAIN Santal Royal 125ml (Eau de Parfum) pour femme Le Parfumeur de la Maison Guerlain, Thierry Wasser, a puisé son inspiration au cœur de l’Orient. Il a travaillé une des plus rares et des plus précieuses matières premières de la Parfumerie : le Santal.', 1465, 'https://www.boutika.co.ma/29205-home_default/guerlain-santal-royal.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10655-guerlain-santal-royal.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(734, 'FENDI L\'Acquarossa', '', 'FENDI L\'Acquarossa ( Eau de Parfum) pour femme L’Acquarossa est une fragrance qui rend hommage aux femmes fortes, fières et raffinéesdont la présence est marquante', 679, 'https://www.boutika.co.ma/29261-home_default/fendi-l-acquarossa.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10683-fendi-l-acquarossa.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(735, 'ROBERTO CAVALLI EDP Pour Femme', '', 'Parfum ROBERTO CAVALLI (Eau de Parfum) Pour Femme Vibrant et sensuelle, elle ragaillardit et hypnotise de la première prise de contact. Certaines femmes d\'attendre pour le monde de les déplacer. Elle se déplace dans le monde et fait tourner les têtes. Sexy, sophistiquée, elle tourne ses excès dans l\'élégance', 559, 'https://www.boutika.co.ma/1597-home_default/parfum-roberto-cavalli.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/773-parfum-roberto-cavalli.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(736, 'ROBERTO CAVALLI Paradiso pour Femmes', '', 'ROBERTO CAVALLI Paradiso (Eau de Parfum) pour Femme Fragrance florale boisée exquise, cette symphonie de notes baignées de soleil est inspirée par les paysages italiens. Un prélude charmant de citrus pétillant se mélange à la bergamote généreuse et à la mandarine sucrée, qui captent l’attention et éveillent les sens', 858, 'https://www.boutika.co.ma/21014-home_default/roberto-cavalli-paradiso-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7771-roberto-cavalli-paradiso-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(737, 'ROBERTO CAVALLI Acqua pour Femme', '', 'ROBERTO CAVALLI Acqua 50ml (Eau de Toilette) pour Femme Intense, sensuelle, sophistiquée, la femme Roberto Cavalli n’a pas d’égale. Le glamour coule dans ses veines, la séduction émane de l’éclat soyeux de sa peau, tantôt dissimulé tantôt dévoilé au rythme de sa démarche féline, laissant derrière elle des regards admiratifs et un sillage parfumé…', 679, 'https://www.boutika.co.ma/21013-home_default/roberto-cavalli-acqua-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7770-roberto-cavalli-acqua-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(738, 'ROBERTO CAVALLI Exotica pour Femme', '', 'ROBERTO CAVALLI Exotica 75ml (Eau de Toilette) pour Femme Roberto Cavalli dévoile une nouvelle facette de son univers avec un parfum exclusif :une fragrance fruitée, exotique et floralequi fait resurgir à l\'esprit des visions d\'îles lointaines, de cieux azur et de jungles tropicales.', 875, 'https://www.boutika.co.ma/21010-home_default/roberto-cavalli-exotica-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7769-roberto-cavalli-exotica-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(739, 'ROBERTO CAVALLI Just Cavalli pour Femme', '', 'ROBERTO CAVALLI Just Cavalli 75ml (Eau de Toilette) pour Femme Un mix tendance d’or, de rose intense et d’imprimé animal. L’alliance de l’or, du rose intense et de l’imprimé python. Tous les fondamentaux Just Cavalli Coloré et sauvagement estampé, ce design marque immédiatement son empreinte dans les linéaires.', 875, 'https://www.boutika.co.ma/20945-home_default/roberto-cavalli-just-cavalli-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7724-roberto-cavalli-just-cavalli-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(740, 'CHANEL N°5', '', 'CHANEL N°5 100 ml (Eau de Parfum) pour femme N°5, l\'essence même de la féminité. Un bouquet floral poudré sublimé par un flacon iconique aux lignes minimalistes. Un parfum mythique et intemporel', 1159, 'https://www.boutika.co.ma/29259-home_default/chanel-n5.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10682-chanel-n5.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(741, 'CHANEL COCO NOIR pour Femme', '', 'COCO NOIR 35 ml (Eau de Parfum) de Coco Chanel pour Femme Radical, singulier, le noir fascine.Son caractère intense et son élégance énigmatique promettent l\'inattendu.De ce noir profond et dense surgit un éblouissement olfactif. Un Oriental Lumineux', 805, 'https://www.boutika.co.ma/4966-home_default/coco-noir-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2166-coco-noir-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(742, 'NARCISO RODRIGUEZ EdT pour Femme', '', 'NARCISO RODRIGUEZ FOR HER 100ml (Eau de Toilette) Pour Femme Une fragrance élégante, sensuelle, mystérieuse et douce. Un coeur de musc exalté par trois facettes : florale, ambrée, boisée. Un flacon au coeur noir et aux lignes épurées', 945, 'https://www.boutika.co.ma/8180-home_default/narciso-rodriguez-edt-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3398-narciso-rodriguez-edt-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(743, 'NARCISO RODRIGUEZ EdP pour Femme', '', 'NARCISO RODRIGUEZ FOR HER 100ml (Eau de Parfum) Pour Femme Au coeur de son eau de parfum, le musc offre sillage et sensualité.Autour, trois pulsations : floral rosé, ambre doux et bois voluptueux.Une eau de parfum dense, profonde et mystérieuse pour une sensuaité glamour.', 1010, 'https://www.boutika.co.ma/8184-home_default/narciso-rodriguez-edp-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3400-narciso-rodriguez-edp-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(744, 'CHLOÉ Love Eau Florale pour Femme', '', 'CHLOÉ Love (Eau Florale) pour Femme Chloé présente le dernier-né de la famille Love : Love, Chloé, Eau Florale… immédiatement identifiable, le sillage Love, Chloé a l’élégance communicative. Un parfum devenu mythique qu’on reconnaît sur celles qui aiment conjuguer le chic et l’hyper féminité. une senteur interprétée aujourd’hui comme un souffle. Délicate...', 720, 'https://www.boutika.co.ma/20692-home_default/chloe-love-eau-florale-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7624-chloe-love-eau-florale-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(745, 'CHLOE Eau de Parfum pour Femme', '', 'CHLOE Eau de Parfum pour Femme Féminine, élégante, naturelle, sexy, l\'Eau de Parfum Chloé est composée d\'une sélection de matières naturelles et raffinées. Le flacon, recouvert d\'une pièce d\'argent authentique est orné d\'un délicat ruban noué à la main. Cet objet unique s\'allie à un sublime parfum de rose pour révéler l\'essence même de Chloé : élégance...', 799, 'https://www.boutika.co.ma/20817-home_default/chloe-eau-de-parfum-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7666-chloe-eau-de-parfum-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(746, 'CHLOE Eau de Parfum Intense pour Femme', '', 'CHLOE Eau de Parfum Intense Chloé Intense : Mystérieux - Séduisant - Fascinant En majesté dans un accord généreux elle sublime la femme Chloé d\'un sillage sensuel et féminin. Un bouquet de roses au coeur velouté où fusent les notes florales du magnolia et du muguet, sublimé par les accents miellés de l\'ambre et du bois de cèdre. Complexe et raffiné, cet...', 869, 'https://www.boutika.co.ma/20733-home_default/chloe-eau-de-parfum-intense-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7641-chloe-eau-de-parfum-intense-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(747, 'CHLOE Love Story pour Femme', '', 'CHLOE Love Story 50 ml(Eau de Parfum) pour Femme Love Story, le nouveau parfum ChloéLa rencontre d’une fleur d’oranger lumineuse et sensuelle avec le jasmin stéphanotis, fleur du bonheur.Bijou précieux symbole d’amour, Le flacon cadenas s’habille du plissé iconique et d’un ruban nonchalamment noué à son côté.', 809, 'https://www.boutika.co.ma/20812-home_default/chloe-love-story-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7663-chloe-love-story-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(748, 'CHLOE See by Chloé Si Belle', '', 'CHLOE See by Chloé Si Belle 50 ml (Eau de Parfum) pour Femme Si Belle soit-elle… son parfum l\'enveloppe et l\'accompagne, soulignant son charme évident et une délicate féminité. Une alliance florale, vive et moderne qui flirte avec d\'étonnantes notes et d\'intrépides accords. Cette édition limitée See by Chloé Si Belle exprime l\'audace, le sourire et...', 799, 'https://www.boutika.co.ma/20803-home_default/chloe-see-by-chloe-si-belle.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7661-chloe-see-by-chloe-si-belle.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(749, 'GUCCI GUILTY Pour Femme', '', 'GUCCI GUILTY75 ml(Eau de Toilette)de Gucci Pour Femme Ne vous sentez jamais coupable de prendre du plaisir ! L’intensité presque épicée du lilas alliée à la profondeur des douces notes ambrées.Un accord pétillant et attirant en tête, avec des notes « piquantes » de baies roses et de mandarine, il affiche une personnalité impertinente', 869, 'https://www.boutika.co.ma/1590-home_default/gucci-guilty-de-gucci.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/770-gucci-guilty-de-gucci.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(750, 'GUCCI PREMIER pour Femme', '', 'GUCCI PREMIER 50 ml(Eau de Parfum) de Gucci pour Femme Gucci Première femme Eau de parfum s\'ouvre avec le luxe et l\'exubérance d\'une cuvée champagne.Il s\'agit d\'un parfum qui incarne le glamour absolu ; féminine, intrigante et séduisante.Gucci Première femme peut être utilisée par les femmes à tous les âges', 876, 'https://www.boutika.co.ma/4932-home_default/gucci-premier-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2150-gucci-premier-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(751, 'GLAMOROUS MAGNOLIA by GUCCI Pour Femme', '', 'FLORAde GUCCI GLAMOROUS MAGNOLIA 100ml (Eau de Toilette) Pour Femme La femme Gorgeous Gardenia dégage une sensualité et une volupté délicieusement attirantes. Elle attire les hommes comme une fleur attire les abeilles.', 920, 'https://www.boutika.co.ma/1422-home_default/glam.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/697-glam.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(752, 'DIOR MISS DIOR Pour Femme', '', 'MISS DIOR de Dior (Eau de Parfum) Pour Femme Romantique, Miss Dior suscite autant qu’elle le poursuit un amour vif et ludique. Elle incarne la joie de vivre spontanée d’une jeune femme d’aujourd’hui. Une façon particulière d’être libre et de plaire. Une fragrance caractérisée par un charme captivant et immédiat', 869, 'https://www.boutika.co.ma/18267-home_default/dior-miss-dior-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6793-dior-miss-dior-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(753, 'Dior DUNE pour ELLE', '', 'Dior DUNE 30mlde Dior (eau de toilette)pour femme Un parfum océanique, conçu en parfaite harmonie avec la nature, cette fragrance rayonnante, fraîche et subtile, capture un paysage où la mer rencontre la terre avec un bouquet océanique et floral. Sérénité et sensualité s’assemblent.', 560, 'https://www.boutika.co.ma/18287-home_default/dior-dune-pour-elle.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6798-dior-dune-pour-elle.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(754, 'DIOR Poison Girl', '', 'Poison Girl (Eau de Parfum) pour femme Poison Girl est le parfum d\'une fille d\'aujourd\'hui, délicieuse et toxique. Un piège sensuel, qui empoisonne instantanément et fait durer le plaisir jusqu\'à l\'addiction', 719, 'https://www.boutika.co.ma/29201-home_default/dior-poison-girl.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10653-dior-poison-girl.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(755, 'DIOR Pure Poison EdP Pour Femme', '', 'PURE POISON de Dior (Eau de Parfum) Pour Femme Il était une fois une séduction innocente et captivante, sincère et énigmatique...Pure Poison célèbre la séduction à l’état le plus pur, en explorant sa dualité et son irrésistible alchimie', 805, 'https://www.boutika.co.ma/15763-home_default/dior-pure-poison-eau-de-parfum-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6065-dior-pure-poison-eau-de-parfum-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(756, 'PLAY GIVENCHY Pour Femme', '', 'PLAYde Givenchy 75 ml (Eau de Parfum) de Givenchy Pour Femme Séduction, énergie, insouciance... Un parfum envoûtant, qui joue la carte de l\'audace pour mieux surprendre et captiver', 865, 'https://www.boutika.co.ma/2155-home_default/play-givenchy.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/1050-play-givenchy.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(757, 'GIVENCHY Organza EdP Pour Femme', '', 'ORGANZA de Givenchy 50 ml (Eau de Parfum) Pour Femme Organza incarne l\'éternel féminin. Les premières notes végétales, de sève et de chèvrefeuille, éveillent l\'attention. Les notes de cœur dévoilent son caractère délicat entre gardenia, ylang-ylang et pivoine, caractère pimenté par les notes pures et chaudes de la vanille et de la muscade', 898, 'https://www.boutika.co.ma/15324-home_default/givenchy-organza-edp-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6008-givenchy-organza-edp-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(758, 'Givenchy Ange ou Démon', '', 'GIVENCHY Ange ou Démon 60 ml (Eau de Parfum) pour femme Ce nouveau parfum féminin signé Givenchy, est une énigme. Cette femme est-elle un ange dont l\'harmonie vous attire ou un démon dont les illusions vous piègent ? Son flacon est une pampille. Il est l\'ombre et la lumière, de l\'éclat du cristal à la profondeur du noir. La fragrance célèbre la rencontre...', 895, 'https://www.boutika.co.ma/29838-home_default/givenchy-ange-ou-demon-jasmin-sambac.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3356-givenchy-ange-ou-demon-jasmin-sambac.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(759, 'VALENTINO Valentina', '', 'VALENTINO Valentina 50 ml (Eau de Parfum) pour femme Les notes intenses du parfum se marient parfaitement à la délicatesse du flacon et à sa pureté cristalline. Ses courbes épurées et élégantes s\'ornent d\'une fleur qui s\'épanouit en blanc, ivoire et nude', 829, 'https://www.boutika.co.ma/29334-home_default/valentino-valentina.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10707-valentino-valentina.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(760, 'VALENTINA ASSOLUTO de Valentino Pour Femme', '', 'Parfum VALENTINA ASSOLUTO 80ml (Eau de Parfum)de Valentino Pour Femme Ce Floral Chypré Italien, Valentina Assoluto, exprime la quintessence de la féminité Valentina, réinterprétée avec unetouche de sophistication, d\'intensité et de mystère', 1168, 'https://www.boutika.co.ma/1589-home_default/valentina-assoluto-de-valentino.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/769-valentina-assoluto-de-valentino.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(761, 'ARMANI SI EdP Pour Femme', '', 'SI de GIORGIO ARMANI (Eau de Parfum) Pour Femme La quintessence du style Armani, entre sensualité et émotion.\"Si est mon hommage à la féminité moderne, un irrésistible mélange de grâce, de force, et d\'esprit d\'indépendance\".Si est le parfum de la féminité et du courage, le courage de dire Si, Si à la vie. La femme Armani l\'affirme avec enthousiasme.', 1086, 'https://www.boutika.co.ma/15213-home_default/armani-si-edp-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/5965-armani-si-edp-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(762, 'Giorgio Armani Diamonds Intense Pour Femme', '', 'Diamonds Intense de Giorgio Armani 30ml (Eau de Parfum) Pour Femme Emporio Armani Diamonds Intense est une édition irrésistible d\'un floral fruitéqui harmonise un symbole de la féminité avec des arômes de rose mélangés avec des accords fruités.Cette combinaison attire et séduit laissant une piste odorante incroyable', 389, 'https://www.boutika.co.ma/8069-home_default/giorgio-armani-diamonds-intense-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3351-giorgio-armani-diamonds-intense-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(763, 'Giorgio Armani ACQUA DI GIO pour Femme', '', 'ACQUA DI GIO (Eau de Toilette) de Giorgio Armani pour Femme Une fragrance aux couleurs de vacances inspirée de l\'île de Pantelleria et des senteurs de son versant sud.Pour une femme à l\'élégance naturelle, avide de liberté et de bien-être', 359, 'https://www.boutika.co.ma/4927-home_default/acqua-di-gio-edt-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2147-acqua-di-gio-edt-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(764, 'ARMANI CODE EdP Pour Femme', '', 'ARMANI CODE de Giorgio Armani (Eau de Parfum) Pour Femmme L\'inspiration d\'Armani Code... un rêve... Le rêve de Monsieur Armani : celui d\'une fleur imaginaire, contrastée qui sculpte et envahit la lumière. Le contraste d\'ombre et de lumière joué par les fleurs reflète le jeu de mystère et de séduction du personnage féminin aussi bien sensuel et glamour que...', 806, 'https://www.boutika.co.ma/15219-home_default/armani-code-edp-pour-femme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/5966-armani-code-edp-pour-femme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 31),
(765, 'DIOR Sauvage pour Homme', '', 'Sauvage de Dior (Eau de Toilette) pour Homme \"Une composition à la fraîcheur radicale, dictée par un nom qui sonne comme un manifeste.\"François Demachy, Parfumeur-Créateur Dior, l’a voulue ainsi : entre brutalité et noblesse.Les ingrédients naturels, sélectionnés avec une extrême exigence, sont joués en surdose.Sauvage est un acte de création inspiré des...', 730, 'https://www.boutika.co.ma/23630-home_default/dior-sauvage-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8632-dior-sauvage-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(766, 'DIOR Homme Cologne', '', 'DIOR Homme Cologne 75ml pour homme Le plaisir simple et immédiat d\'une fraîcheur hespéridée habillée d\'un sillage subtilement enveloppant. Une fraîcheur blanche à l\'élégance désinvolte, comme une \"cotonnade olfactive\"', 755, 'https://www.boutika.co.ma/29218-home_default/dior-homme-cologne.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10662-dior-homme-cologne.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(767, 'DIOR Eau Sauvage', '', 'DIOR Eau Sauvage 100ml (Eau de Toilette) pour femme Un hespéridé aromatique distingué et affirmé.Révolution d\'hier, grand classique d\'aujourd\'hui. Moderne absolument...', 939, 'https://www.boutika.co.ma/29217-home_default/dior-eau-sauvage.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10661-dior-eau-sauvage.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(768, 'DIOR Homme Sport', '', 'DIOR Homme Sport 100ml (Eau de Toilette) Un boisé sexy à la fraîcheur juteuse et épicDior Homme Sport se réinvente pour mieux incarner une vie où le sport est devenu une philosophie plus qu\'une course à la performance', 920, 'https://www.boutika.co.ma/29220-home_default/dior-homme-sport.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10663-dior-homme-sport.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32);
