(769, 'DAVIDOFF Cool Water', '', 'DAVIDOFF Cool Water 75 ml (Eau de Toilette) pour homme Une fraîcheur extraordinaire qui stimule la force et la sensualité de l\'homme. Capturant l\'énergie de l\'océan', 869, 'https://www.boutika.co.ma/29256-home_default/davidoff-cool-water.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10681-davidoff-cool-water.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(770, 'DIOR FAHRENHEIT Pour Homme', '', 'Parfum DIOR FAHRENHEIT 75 ml Pour Homme Fahrenheit Eau de Toilette est un parfum boisé cuir. Un parfum unique. L’alliance de la Violette et de notes boisées-cuirées', 968, 'https://www.boutika.co.ma/1365-home_default/diorfahrenheit.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/668-diorfahrenheit.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(771, 'DIOR HOMME INTENSE', '', 'DIOR HOMME INTENSE (Eau de Parfum) de Dior Porter un parfum comme on porte le smoking… Troisième volet de la trilogie Dior Homme, Dior Homme Intense en est le chapitre le plus audacieux : une Eau de Parfum pour le soir, intense, sophistiquée et sensuelle, en édition limitée', 876, 'https://www.boutika.co.ma/4896-home_default/dior-homme-intense.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2132-dior-homme-intense.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(772, 'DIOR HOMME', '', 'DIOR HOMME 50 ml (Eau de Toilette) de Dior Réconciliation entre tradition et modernité.Ce parfum poudré est construit autour de l\'iris avec des échos aromatiques et boisés. L\'élégance d\'un Iris au masculin sur un fond de Vétiver. Le Classique nouvelle génération : haut de gamme, élégant, masculin.', 825, 'https://www.boutika.co.ma/4866-home_default/dior-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2125-dior-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(773, 'GIORGIO ARMANI Acqua Di Giò pour Homme', '', 'GIORGIO ARMANI Acqua Di Giò (Eau de Toilette) pour homme Un parfum authentique et naturel qui représente la puissance masculine dans son plus pur accomplissement.', 359, 'https://www.boutika.co.ma/29272-home_default/giorgio-armani-acqua-di-gio-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10688-giorgio-armani-acqua-di-gio-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(774, 'GIORGIO ARMANI Acqua Di Gio Homme Profumo', '', 'GIORGIO ARMANI Acqua Di Gio Homme Profumo 75ml Ce dernier opus du célèbre créateur italien est un parfum profond et sophistiqué, intensément masculin, à la fraîcheur minérale qui symbolise la rencontre de la mer et de la roche.', 879, 'https://www.boutika.co.ma/20879-home_default/giorgio-armani-acqua-di-gio-homme-profumo.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7693-giorgio-armani-acqua-di-gio-homme-profumo.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(775, 'ARMANI Code Profumo', '', 'ARMANI Code Profumo 110 ml pour homme Pour l\'homme moderne Armani Code, la séduction est un art, un style de vie, une maîtrise parfaite de tous les codes. Armani Code Profumo, la nouvelle fragrance intense et vibrante, à la présence enivrante.', 995, 'https://www.boutika.co.ma/29269-home_default/armani-code-profumo.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10687-armani-code-profumo.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(776, 'GIORGIO ARMANI Diamonds for Men', '', 'GIORGIO ARMANI Diamonds for Men 75ml pour Homme un boisé aromatique gourmand pour un homme décidé, audacieux, à la jeunesse insolente.A la fois tendance et élégant, l\'homme Emporio Armani Diamonds est un séducteur sexy et extraverti.Emporio Armani Diamonds for Men, une signature fraîche, addictive, inattendue. Un parfum qui se fond à la peau pour mieux...', 729, 'https://www.boutika.co.ma/20827-home_default/giorgio-armani-diamonds-for-men.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7667-giorgio-armani-diamonds-for-men.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(777, 'Dolce & Gabbana LIGHT BLUE Pour Homme', '', 'LIGHT BLEU de Dolce & Gabbana (Eau de Toilette) Pour Homme Dolce & Gabbana Light Blue Pour Homme, un nouveau parfum aux notes masculines pour l\'homme qui incarne l\'état d\'esprit méditerranéen : charmant, sexy et séducteur.Light Blue Pour Homme se caractérise par son charme et sa fraîcheur sophistiquée', 550, 'https://www.boutika.co.ma/1616-home_default/light-blue-de-dolcegabbana.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/783-light-blue-de-dolcegabbana.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(778, 'Dolce & Gabbana THE ONE SPORT Pour Homme', '', 'THE ONE SPORT de Dolce & Gabbana (Eau de Toilette) Tel un gladiateur des temps modernes, l\'homme Dolce & Gabbana fait face aux défis qui s\'offrent à lui par son physique et sa combativité. Ce parfum \"habille\" votre corps, il est générateur d\'énergie et de puissance', 660, 'https://www.boutika.co.ma/1445-home_default/the-one-sport-de-dolcegabbana.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/706-the-one-sport-de-dolcegabbana.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(779, 'Dolce & Gabbana The One for Men', '', 'Dolce & Gabbana The One for Men (Eau de Parfum) pour Homme Dolce&Gabbana Fragrances présente The One for Men Eau de Parfum, inspiré de l’univers emblématique The One. Proposant une expérience olfactive plus intense, The One for Men Eau de Parfum constitue le choix idéal d’un véritable passionné.', 735, 'https://www.boutika.co.ma/29129-home_default/dolce-gabbana-the-one-for-men-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7620-dolce-gabbana-the-one-for-men-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(780, 'DOlce & Gabbana The One Gentlemen Pour Homme', '', 'THE ONE GENTLEMEN de Dolce & Gabbana 100ml (Eau de Toilette) Pour Homme D’une sophistication extrême, la dernière fragrance The One Gentleman de Dolce&Gabbana est une révérence olfactive au nouvel homme, le gentleman moderne.The One Gentleman est le parfum des connaisseurs : son bouquet de fougère orientale sublime une prestance discrète et une...', 820, 'https://www.boutika.co.ma/15980-home_default/dolce-gabbana-the-one-gentlemen-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6162-dolce-gabbana-the-one-gentlemen-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(781, 'Dolce & Gabbana 21 Le Fou pour LUI', '', 'Dolce & Gabbana 21 Le Fou 100ml (eau de toilette ) pour homme Une fragrance oriental fougère pour impoviser. C\'est un parfum qui s\'adresse au hommes spontanés, non conventionel et insouciant, d\'où son nom : 21 Le Fou.', 738, 'https://www.boutika.co.ma/18295-home_default/dolce-gabbana-21-le-fou-pour-lui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6808-dolce-gabbana-21-le-fou-pour-lui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(782, 'Dolce & Gabbana 14 La temperance pour LUI', '', 'Dolce & Gabbana 14 La temperance 100ml (eau de toilette ) pour homme La Tempérance débute sur des baies roses mêlées aux effluves musqués des graines d’ambrette. Le cœur fleuri allie hibiscus, rose et iris et évolue vers un fond oriental et musqué, adouci de patchouli.', 738, 'https://www.boutika.co.ma/18293-home_default/dolce-gabbana-14-la-temperance-pour-lui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6807-dolce-gabbana-14-la-temperance-pour-lui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(783, 'ROBERTO CAVALLI Just Cavalli Gold pour Homme', '', 'ROBERTO CAVALLI Just Cavalli Gold (Eau de Parfum) pour Homme L\'excitation par l\'excès. Telle est son addiction. Charismatique puissant et masculin brutal, JUST GOLD for Him est une Eau de Parfum boisée épicée', 755, 'https://www.boutika.co.ma/20954-home_default/roberto-cavalli-just-cavalli-gold-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7731-roberto-cavalli-just-cavalli-gold-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(784, 'GUESS Night Access', '', 'GUESS Night Access 50 ml (Eau de Toilette) pour homme Une masculinité, une séduction et un sex appeal naturels dans cette fragrance pour l\'homme qui entend conquérir la nuit. Une plongée au cœur de la vie nocturne, où seules les lumières de la ville en seront témoins', 405, 'https://www.boutika.co.ma/29238-home_default/guess-night-access.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10671-guess-night-access.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(785, 'BVLGARI Man Black Cologne', '', 'BVLGARI Man Black Cologne (Eau de Toilette) pour homme Bulgari Man Black Cologne est une Eau de Toilette orientale fraîche, raffinée et masculine, à l\'esprit ultra-contemporain', 695, 'https://www.boutika.co.ma/29318-home_default/bvlgari-man-black-cologne.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10700-bvlgari-man-black-cologne.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(786, 'BVLGARI Man Extrême', '', 'BVLGARI Man Extrême (Eau de Toilette) pour homme Élégante, imposante et addictive, Bvlgari Man Extrême est une Eau de Toilette boisée fraîche.Une extrême fraîcheur méditerranéenne', 699, 'https://www.boutika.co.ma/29282-home_default/bvlgari-man-extreme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10693-bvlgari-man-extreme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(787, 'BVLGARI Man', '', 'BVLGARI Man 100 ml (Eau de Toilette) pour homme Bvlgari dévoile une création empreinte de force et d\'éclat. Une vision élégante et raffinée de la masculinité, marquée par la redécouverte du naturel et un retour à l\'essentiel, incarnant un homme authentique, radieux et profondément charismatique.', 887, 'https://www.boutika.co.ma/29314-home_default/bvlgari-man.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10698-bvlgari-man.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(788, 'BVLGARI Man in Black pour Homme', '', 'Man in Black de Bvlgari (Eau de Parfum) Pour Homme Dédiée aux hommes qui veulent séduire et qui sont à la recherche d’un parfum oriental raffiné et sensuel avec une signature olfactive puissante.', 749, 'https://www.boutika.co.ma/19808-home_default/bvlgari-man-in-black-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7289-bvlgari-man-in-black-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(789, 'BVLGARI Man Black Orient', '', 'BVLGARI Man Black Orient 60 ml (Eau de Parfum) pour homme Bulgari Black Orient est un parfum rare, un extrait ultime, alliant de beaux et précieux composants.Un parfum puissant boisé ,épicé, au sillage persistant', 846, 'https://www.boutika.co.ma/29317-home_default/bvlgari-man-black-orient.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10699-bvlgari-man-black-orient.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(790, 'BVLGARI AQVA POUR HOMME', '', 'Parfum BVLGARI ACQVA 50ml Pour Homme de Bulgari (Eau de Toilette) Aquatique, noble et masculin, AQVA Pour Homme est inspiré du pouvoir et de la beauté de la Mer. La senteurest structurée à partir d\'une interprétationbasée sur la Posidonie, algue produisant de l\'oxygène que l\'ont trouve dans lesprofondeurs de la Mer', 665, 'https://www.boutika.co.ma/1453-home_default/bulgari-aqva-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/710-bulgari-aqva-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(791, 'Mauboussin Pour Lui', '', 'Mauboussin Pour Lui 100 ml (Eau de Parfum) pour homme La masculinité selon Mauboussin est un mélange subtil entre la puissance et l\'expression sensible des émotions. Fort et fragile à la fois, l\'homme Mauboussin séduit en revendiquant une virilité nouvelle : explorée toute en nuance et pleine d\'émotion.', 730, 'https://www.boutika.co.ma/29320-home_default/mauboussin-pour-lui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10701-mauboussin-pour-lui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(792, 'CERRUTI 1881 Bella Notte pour Homme', '', 'CERRUTI 1881 Bella Notte 75ml (Eau de Toilette) pour Homme Bella Notte possède le charisme des parfums nés pour habiller la peau.Sensuel et élégant, ce nouveau parfum masculin s’appuie sur une composition boisée épicée, écrite par Olivier Cresp, déjà auteur de Cerruti 1881 Acqua Forte. D’emblée, le parfumeur a choisi de créer un souffle d’épices autour du...', 620, 'https://www.boutika.co.ma/20901-home_default/cerruti-1881-bella-notte-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7709-cerruti-1881-bella-notte-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(793, 'CERRUTI 1881 Acqua Forte pour Homme', '', 'CERRUTI 1881 Acqua Forte (Eau de Toilette) pour Homme Une eau vive et signée d’où jaillissent les éclats boisés et hespéridés d’un parfum à l’élégance innée. Un sillage sans surenchère, dans lequel la joie de vivre, le plaisir et, finalement, un certain hédonisme, se lisent aussi clairement que l’eau', 620, 'https://www.boutika.co.ma/20885-home_default/cerruti-1881-acqua-forte-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7698-cerruti-1881-acqua-forte-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(794, 'CERRUTI 1881 Édition Blanche pour Homme', '', 'CERRUTI 1881 Édition Blanche 100ml (Eau de Toilette) pour Homme Edition Blanche épouse la peau comme une chemise blanche fraîchement repassée. L\'Homme : Elégant et décontracté, un homme moderne au chic naturel', 805, 'https://www.boutika.co.ma/20937-home_default/cerruti-1881-edition-blanche-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7721-cerruti-1881-edition-blanche-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(795, 'CERRUTI 1881 Fairplay pour Homme', '', 'CERRUTI 1881 Fairplay 100ml (Eau de Toilette) pour Homme Il s\'agit d\'une fragrance masculine, dynamique, aux accords bien rythmés entre des notes de tête fraîches et modernes, et un fond texturé et boisé. Une recherche de fluidité et de limpidité comme un souffle d\'air', 809, 'https://www.boutika.co.ma/20900-home_default/cerruti-1881-fairplay-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7706-cerruti-1881-fairplay-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(796, 'CERRUTI 1881 Pour Homme', '', 'CERRUTI 1881 100ml (Eau de Toilette) pour Homme La fragrance CERRUTI 1881 Pour Homme s\'adresse aux hommes qui considèrent le parfum comme un moyen d\'expression privilégié. L\'homme Cerruti est sûr de lui, réfléchi et moderne. Référence à l\'année de création de la maison de couture Cerruti, Cerruti 1881 est une alliance parfaite de savoir-faire ancestral et...', 805, 'https://www.boutika.co.ma/20908-home_default/cerruti-1881-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7711-cerruti-1881-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(797, 'Yves Saint Laurent L\'homme pour LUI', '', 'Yves Saint Laurent L\'homme100ml( eau de toilette ) pourhomme L\'Homme Yves Saint Laurent : la force d\'attraction d\'un homme au style unique, fait de charisme, d\'audace et de sensualité. L\'équilibre parfait entre le brut et le précieux, l\'ultra-masculinité et le raffinement, l\'industriel et le luxueux. Un parfum frais et boisé. Bergamote - Gingembre -...', 798, 'https://www.boutika.co.ma/18345-home_default/yves-saint-laurent-l-homme-pour-lui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6830-yves-saint-laurent-l-homme-pour-lui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(798, 'Yves Saint Laurent La Nuit de L\'homme Le...', '', 'La Nuit de L\'homme Le Parfum de Yves Saint Laurent (Eau de parfum) Pour Homme Une nuit pleine de promesses.Un séducteur au charme ravageur, à la beauté ténébreuse qui emporte tout sur son passage.La nouvelle facette de la masculinité Yves Saint Laurent : Le Parfum, quintessence de la séduction', 759, 'https://www.boutika.co.ma/18365-home_default/yves-saint-laurent-la-nuit-de-l-homme-le-parfum.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6841-yves-saint-laurent-la-nuit-de-l-homme-le-parfum.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(799, 'Yves Saint Laurent LA NUIT DE L\'HOMME', '', 'LA NUIT DE L\'HOMME de Yves Saint Laurent 60 ml(Eau de Parfum) pour Homme Une nuit pleine de promesses.Un séducteur au charme ravageur, à la beauté ténébreuse qui emporte tout sur son passage.Une facette de la masculinité Yves Saint Laurent : Le Parfum, quintessence de la séduction', 759, 'https://www.boutika.co.ma/29141-home_default/la-nuit-de-l-homme-ysl.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/1453-la-nuit-de-l-homme-ysl.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(800, 'Yves Saint Laurent M7 Oud Absolu', '', 'Yves Saint Laurent M7 Oud Absolu 80ml de Yves Saint Laurent ( eau de toilette ) pour homme et femme M7 est l\'aboutissement de la libération de l\'homme dans sa relation au corps et à la sexualité : le parfum masculin YSL le plus expressif et direct.', 817, 'https://www.boutika.co.ma/18340-home_default/yves-saint-laurent-m7-oud-absolu-pour-lui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6828-yves-saint-laurent-m7-oud-absolu-pour-lui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(801, 'GUCCI GUILTY BLACK pour Homme', '', 'GUCCI GUILTY BLACK (Eau de Toilette) pour Homme Ce parfumse distingue par l’intensité de la fougère VERTE. Ici, l’énergie transcende le pouvoir de séduction.La fragrance débute avec de la coriandre verte et de la lavande, annonçant le coeur vert floral fait de fleur d\'oranger, néroli. La base apporte un mélange boisé puissant de cèdre et de patchouli', 749, 'https://www.boutika.co.ma/4863-home_default/gucci-guilty-black-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2123-gucci-guilty-black-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(802, 'TOM FORD Noir EDP', '', 'TOM FORD NOIR 100ml (Eau de Parfum) Pour Homme Inspiré du fascinant contraste entre l’élégance et la sensualité. Tom Ford Noir est une fragrance orientale et sensuelle, qui capture les deux facettes de la personnalité de l’homme Tom Ford ; l’homme raffiné et sophistiqué connu de tous, et la sensualité intrigante de l’homme privé', 1136, 'https://www.boutika.co.ma/9222-home_default/tom-ford-noir-pour-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3858-tom-ford-noir-pour-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(803, 'TOM FORD Noir EDT', '', 'TOM FORD Noir 100 ml (Eau de Toilette) pour homme Portrait olfactif frais et mystérieux, il est le reflet d\'une sensualité charnelle dissimulée. Cette fragrance est une manière fraîche et énergique de porter Tom Ford Noir', 975, 'https://www.boutika.co.ma/29278-home_default/tom-ford-noir-edt.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10691-tom-ford-noir-edt.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(804, 'TOM FORD Noir Extreme', '', 'TOM FORD Noir Extreme 100 ml (Eau de Parfum) pour homme Interprétation intense et distinguée de la sensualité, Tom Ford Extrême exprime un style impeccable et une confiance inébranlable Une fragrance qui réinvente le genre des boisés avec une version puissante et complexe grâce à ses notes de cuir, safran et coriandre.', 1319, 'https://www.boutika.co.ma/29280-home_default/tom-ford-noir-extreme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10692-tom-ford-noir-extreme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(805, 'BALDESSARINI PRIVATE AFFAIRE Pour Homme', '', 'Parfum BALDESSARINI PRIVATE AFFAIRE de Hugo Boss 50ml (Eau de Toilette) Pour Homme \"Distingue les hommes des grands garçons\", telle est la devise des parfums Baldessarini, ultime luxe masculin', 569, 'https://www.boutika.co.ma/1368-home_default/baldessarini-private-affaire.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/669-baldessarini-private-affaire.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(806, 'FRANCESCO SMALTO POUR HOMME', '', 'FRANCESCO SMALTO POUR HOMME edt 50 ml Le parfum Classic de la Maison Smalto mélange subtilement les traits énergiques de l\'homme actif à la douceur masculine. Les notes de tête de bergamote, lavande et sauge sont apprivoisées par la délicatesse de l’œillet, mythique symbole de l\'héritage tailleur de la Maison.', 423, 'https://www.boutika.co.ma/7331-home_default/francesco-smalto-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3055-francesco-smalto-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(807, 'AZZARO CHROME Pour Homme', '', 'Parfum AZZARO CHROME de Azzaro 100ml (Eau de Toilette) Pour Homme Notes de tête: Bergamote, Citron, Ananas, Néroli, Romarin Notes de coeur: Jasmin, Coriandre, Violette des Alpes, Mousse de chêne Notes de fond: Bois de santal, Mousse de chêne, Fève tonka, Cardamone, Bois de rose, Musc, Cèdre', 657, 'https://www.boutika.co.ma/1587-home_default/azzaro-chrome.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/749-azzaro-chrome.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(808, 'JUST DIFFERENT de Hugo Boss Pour Homme', '', 'JUST DIFFERENT de Hugo Boss 125 ml (Eau de Toilette) Pour Homme C\'est un parfum vibrant et vivifiant qui vous inspire pour voir les choses différemment, loin de la monotonie du quotidien. C\'est le parfum palpitant de la jungle urbaine, la nuit, le lieu où la créativité irrévérencieuse règne en maître', 659, 'https://www.boutika.co.ma/8011-home_default/just-different-de-hugo-boss-pour-homme-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3327-just-different-de-hugo-boss-pour-homme-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(809, 'HUGO BOSS Red pour LUI', '', 'HUGO BOSS Red de HUGO BOSS ( eau de toilette ) pour homme Un flacon thermosensible qui réagit à la chaleur de votre main. Une alliance de notes chaudes et boisées et de notes fraîches et métalliques pour exprimer votre originalité. Là où les autres s’arrêtent, dépassez vos limites avec Hugo Red.', 517, 'https://www.boutika.co.ma/18335-home_default/hugo-boss-red-pour-lui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6825-hugo-boss-red-pour-lui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(810, 'HUGO BOSS Orange pour LUI', '', 'HUGO BOSS Orange de HUGO BOSS 40 ml( eau de Toilette )pour homme Ouverture d\'esprit. Liberté d\'être.Boss Orange Man est un parfum généreux qui mêle l\'énergie de la pomme croquante, la chaleur de l\'encens et le confort de la vanille....', 498, 'https://www.boutika.co.ma/18299-home_default/hugo-boss-orange-pour-lui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6810-hugo-boss-orange-pour-lui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(811, 'HUGO BOSS Bottled Night Pour LUI', '', 'HUGO BOSS Bottled Night de HUGO BOSS (eau de toilette ) pour homme Cette nouvelle fragrance, séduisante et résolument masculine, est plus qu\'un parfum : c\'est un langage, le langage de la nuit, qui va permettre à l\'homme Boss de conquérir un nouveau territoire...', 513, 'https://www.boutika.co.ma/18323-home_default/hugo-boss-bottled-night-pour-lui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6817-hugo-boss-bottled-night-pour-lui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
