(813, 'HUGO BOSS Bottled Sport pour LUI', '', 'HUGO BOSS Bottled Sport de HUGO BOSS( eau de toilette ) pour LUI Découvrez la 3ème facette de l’Homme Boss Bottled au travers de cette fragrance fraîche, stimulante et assurément masculine. Elle accompagne l’Homme dans sa préparation mentale et sa concentration afin d’être prêt à relever tous les défis.', 641, 'https://www.boutika.co.ma/18320-home_default/hugo-boss-bottled-sport-pour-lui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6815-hugo-boss-bottled-sport-pour-lui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
