(816, 'HUGO BOSS Bottled OUD', '', 'HUGO BOSS Bottled OUD 100 ml (Eau de Parfum) pour homme La maison Hugo Boss est connue pour son élégance et son raffinement au masculin. L’homme Hugo Boss est élégant, moderne et un brin séducteur… C’est dans cet esprit, qu’un nouveau parfum est né «Boss Bottled Oud»', 879, 'https://www.boutika.co.ma/29331-home_default/hugo-boss-bottled-oud.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10705-hugo-boss-bottled-oud.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(817, 'Parfum HUGO XY Pour Homme', '', 'HUGO XY de Hugo Boss 60 ml (Eau de Toilette) Pour Homme Hugo XY est une interprétation parfumée de l\'irrévérence Hugo pour un homme plus mature. Revisitée, cette nouvelle attitude s\'exprime autour d\'un bouquet aromatique vert intense alliant menthe et basilic', 589, 'https://www.boutika.co.ma/1398-home_default/parfum-hugo-xy-60ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/685-parfum-hugo-xy-60ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(818, 'HUGO BOSS XY pour LUI', '', 'HUGO BOSS XY 100ml de HUGO BOSS pour homme HUGO XY est une composition peu habituelle et très marquée de notes pétillantes, fraîches et d’épices vertes. La technologie Time Release exclusive permet à l’odeur du parfum de rester exceptionnellement longtemps sur la peau. Le parfum vert, épicé est en parfaite harmonie avec HUGO XX, le parfum de votre...', 742, 'https://www.boutika.co.ma/18338-home_default/hugo-boss-xy-pour-lui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/6826-hugo-boss-xy-pour-lui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
(819, 'Paco Rabanne BLACK XS Pour Homme', '', 'BLACK XS de Paco Rabanne 50ml (Eau de Toilette) Pour Homme Note de tête: Citrone de Calabre, Kalamanzi, Tagète, Sauge Note de coeur: Praline, Cannelle, Baume Tolu, Cardamome Noire Note de fond: Bois de Palissandre, Ambre Noire, Patchouli, Bois d\'ébène', 545, 'https://www.boutika.co.ma/1354-home_default/parfum-black-xs-de-paco-rabanne.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/665-parfum-black-xs-de-paco-rabanne.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 32),
