(858, 'FESTINA Montre Chrono Acier Dorée Homme', '', 'Lesmontres Festinaen aciersont desmontres sportaux allures demontres de luxe. Elles allient parfaitement l\'élégance à la performance. Comme toutes les autresFestina, ce sont desmontresde qualité et de précision.', 2900, 'https://www.boutika.co.ma/22534-home_default/festina-montre-chrono-acier-doree-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8300-festina-montre-chrono-acier-doree-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 34);
