(860, 'FESTINA Montre Argentée Marron Chrono Bike...', '', 'Festina confectionne des montres alliant confort, design et robustesse. La nouvelle collection Chrono Bike perpétue l’esprit sportif tout en soulignant les courbes audacieuses qui ont fait sa renommée. CettemontreFestinaF16774-3est entièrement réalisée en acier. Elle séduira aussi bien les sportifs que les hommes classiques. Ce bijou est muni d’un...', 2950, 'https://www.boutika.co.ma/22543-home_default/festina-montre-argentee-marron-chrono-bike-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8302-festina-montre-argentee-marron-chrono-bike-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 34),
(861, 'FESTINA Montre Chrono Bike Bleue Argentée...', '', 'Festina est connue pour ses montres de qualité exceptionnelle. La nouvelle collection Chrono Bike perpétue l’esprit sportif tout en soulignant les courbes audacieuses qui ont fait sa renommée. CettemontreFestinaF16774-5est entièrement réalisée en acier. Elle est munie d’un dateur et d’un chronographe. Le bracelet en maille reflète la force et la...', 2950, 'https://www.boutika.co.ma/22546-home_default/festina-montre-chrono-bike-bleue-argentee-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8303-festina-montre-chrono-bike-bleue-argentee-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 34),
(862, 'Calvin Klein City Montre Homme', '', 'Dans classique, il y a « classe ». Ce modèle Chrono City possède la fonction chronographe et vous indique également la date. Le cadran arbore un fond gris foncé. Cette montre avec bracelet en cuir marron est simple, sobre et chic, tout simplement. • Mouvement Swiss made• Le boitier PVD or rose est magnifiquement mis en valeur par le bracelet cuir marron...', 3800, 'https://www.boutika.co.ma/22285-home_default/calvin-klein-city-montre-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8257-calvin-klein-city-montre-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 34),
(863, 'Calvin Klein Wordly Montre Homme', '', 'Horloge CK (Calvin Klein), Collection mondain,bracelet en cuir noir cadran argenté couronne 12 h, la taille du boîtier: 42 mm, bracelet réglable Résistance à l\'eau: 3 atm Avec des détails suisses et un flair international, cette montre Worldly Calvin Klein est vraiment originale.', 3300, 'https://www.boutika.co.ma/22292-home_default/calvin-klein-wordly-montre-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8258-calvin-klein-wordly-montre-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 34),
(864, 'Michael Kors Homme -MK8351-', '', 'Cette belle Chronomètre une montre de Michael Kors Collection dispose avec cadran bleu globe-impression et d\'argent arrêts de temps de couleur et les mains. Il est livré avec fenêtre et compteurs d\'affichage de la date. Il a une couleur d\'Argent inoxydable boîtier et le bracelet en acier couleur. Votre style sera toujours élégant avec cette montre de luxe.', 2800, 'https://www.boutika.co.ma/20716-home_default/michael-kros-homme-mk8351-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7634-michael-kros-homme-mk8351-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 34),
(865, 'Montre Guess Homme -W0247G4-', '', 'Soyez toujours à l’heure pour vos rendez-vous et autres occasions avec cette montre classique. Elle arbore une couleur éclatante ainsi qu’un cadran très lumineux pour un style à mi-chemin entre chic et décontraction.    Modèle G4 : Couleur cadran: noir. Couleur boîtier:  argent. Coulur bracelet: noir.', 2300, 'https://www.boutika.co.ma/20637-home_default/montre-guess-homme-w0247g4.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7587-montre-guess-homme-w0247g4.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 34),
