(1327, 'NUXE Aroma Vaillance Roll-On Express...', '', 'Pratique et efficace, ce stylo roll’on cible les rides profondes des yeux, du front et des lèvres pour un effet liftant immédiat : un geste précis pour une action ciblée.', 267, 'https://www.boutika.co.ma/23306-home_default/nuxe-aroma-vaillance-roll-on-express-combleur-rides-profondes.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8512-nuxe-aroma-vaillance-roll-on-express-combleur-rides-profondes.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1328, 'NUXE Crème Fraîche de Beauté Suractivée...', '', 'Nuxe Crème FraîcheConcentrée de Beauté Suractivée est un vrai soin réconfort, la texture de la crème fraîche concentrée de beauté SURACTIVEE enveloppe la peau d\'un confort durable.Avec Nuxe Crème Fraîche Concentrée de Beauté Suractivée les peaux qui tiraillent retrouvent un confort absolu. Intensément hydratées, elles redeviennent, comme par magie,...', 163, 'https://www.boutika.co.ma/23316-home_default/nuxe-creme-fraiche-de-beaute-suractivee-peaux-normales.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8522-nuxe-creme-fraiche-de-beaute-suractivee-peaux-normales.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1329, 'NUXE Gel Démaquillant Fondant aux Pétales...', '', 'Efficace par nature : Ce Gel Démaquillant sans savon nettoie et démaquille tout en douceur le visage et les yeux.Des bienfaits précieux pour ma peau : Une texture fondante et onctueuse qui ne dessèche pas la peau. La peau est parfaitement nette, démaquillée et clarifiée.Le Gel Démaquillant Fondant nettoie et démaquille en douceur (Dérivé de Coco) sans...', 112, 'https://www.boutika.co.ma/23331-home_default/nuxe-gel-demaquillant-fondant-aux-petales-de-rose.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8533-nuxe-gel-demaquillant-fondant-aux-petales-de-rose.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1330, 'NUXE Merveillance Expert Crème Nuit...', '', 'Efficace par nature :Nuit après nuit, cettecrème anti-âge, à l\'Oléoactif® de Lys d\'un Jour, raffermit la peauet comble les rides installées. La peau est régénérée et au réveil, elle est défroissée. 50 ml', 297, 'https://www.boutika.co.ma/23349-home_default/nuxe-merveillance-expert-creme-nuit-regenerante.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8548-nuxe-merveillance-expert-creme-nuit-regenerante.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1331, 'VICHY AQUALIA THERMAL YEUX', '', 'VICHY AQUALIA THERMAL YEUXPour les femmes au contour de l\'œilcerné, fatigué, déshydraté ou marqué par des stries de déshydratation.Hydrogel Fortifiant Anti-Poches Anti-cernes', 140, 'https://www.boutika.co.ma/5601-home_default/vichy-aqualia-thermal-yeux.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2420-vichy-aqualia-thermal-yeux.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1332, 'VICHY DÉMAQUILLANT INTÉGRAL', '', 'VICHY DÉMAQUILLANT INTÉGRAL 3en1 200ml Un soin 3 en 1: Lait nettoyant, Lotion tonique, Demaquillant yeux pour les femmes à la peau sensible. Elimine parfaitement et en un seul geste toute trace de maquillage du visage et des yeux et tonifie la peau. Laisse la peau nette et fraîche, étonnamment douce.', 129, 'https://www.boutika.co.ma/5756-home_default/vichy-demaquillant-integral.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2486-vichy-demaquillant-integral.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1333, 'SVR Chronolys Crème Bonne Mine', '', 'SVR Chronolys Crème Bonne MineRessource la peau intensément. Sublime l’éclat du teint grâce aux micro-nacres cuivrées. Protège des méfaits des UV quotidiens : SPF15. Prévient l’apparition des premiers signes de l’âge', 197, 'https://www.boutika.co.ma/6046-home_default/svr-chronolys-creme-bonne-mine.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2581-svr-chronolys-creme-bonne-mine.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1334, 'SVR RUBIALINE MASQUE', '', 'SVR RUBIALINE MASQUE 50ml Rubialine Masque lutte efficacement contre les sensations d\'échauffements grâce à un actif spécifique avec un effet frais, immédiat et longue durée. Rubialine Masque est extrêmement bien toléré par les peaux les plus sensibles.', 180, 'https://www.boutika.co.ma/7749-home_default/svr-rubialine-masque.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3218-svr-rubialine-masque.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1335, 'NUXE Aroma-Perfection Fluide Prodigieux 30ml', '', 'Aroma-Perfection avec son programme de 3 soins complémentaires, est la nouvelle réponse végétale, active et plaisir permettant d\'agir contre les 4 principales imperfections des peaux mixtes et grasses :la brillance (l\'hyperséborrhée)les boutons (la prolifération bactérienne)les pores dilatés (l\'hyperkératinisation)les rougeurs (les...', 165, 'https://www.boutika.co.ma/23301-home_default/nuxe-aroma-perfection-fluide-prodigieux-30ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8507-nuxe-aroma-perfection-fluide-prodigieux-30ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1336, 'NUXE Crème fraiche Masque Réhydratant et...', '', 'Un masque hydratant source de bien-être et de fraîcheur immédiate, qui hydrate la peau et l’apaise pour un effet SOS immédiat sur les inconforts cutanés (picotements, rougeurs, échauffements, etc.). Une texture innovante avec un équilibre parfait entre confort et fraîcheur. Hydratée et apaisée pendant 24h, la peau est éclatante ; les traits du visage et...', 170, 'https://www.boutika.co.ma/23320-home_default/nuxe-creme-fraiche-masque-rehydratant-et-apaisant-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8526-nuxe-creme-fraiche-masque-rehydratant-et-apaisant-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1337, 'NUXE Merveillance Expert Crème Riche...', '', 'Efficace par nature :La Crème Merveillance Enrichie de Nuxe est indiquée pour combler et estomper les rides d\'expression installées du visage, et pour nourrir la peau très sèche.Cettecrème anti-âge, à l\'Oléoactif®de Lys d\'un Jour, lutte contre les rides installées et la pertede fermeté. Immédiatement, cette crème riche nourrit et lisse la peau. Jour...', 297, 'https://www.boutika.co.ma/23351-home_default/nuxe-merveillance-expert-creme-riche-correctrice-pour-peaux-seches-a-tres-seches.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8549-nuxe-merveillance-expert-creme-riche-correctrice-pour-peaux-seches-a-tres-seches.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1338, 'VICHY DÉMAQUILLANT INTÉGRAL', '', 'Vichy demaquillant integral 3en1 300ml Un soin 3 en 1: Lait nettoyant, Lotion tonique, Demaquillant yeux pour les femmes à la peau sensible. L\'association d\'agents-nettoyants ultra-efficaces et ultra-doux dans un lait-gel très frais vous offre un nettoyage et un démaquillage ultra-rapide, ultra-facile qui élimine efficacement le maquillage tout en...', 148, 'https://www.boutika.co.ma/5754-home_default/vichy-demaquillant-integral.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2485-vichy-demaquillant-integral.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1339, 'VICHY EAU THERMAL', '', 'VICHY EAU THERMAL 150ml L\'Eau Thermale de Vichy apaise les peaux sensibles. L\'Eau Thermale de Vichy est reconnue en médecine pour favoriser les échanges cellulaires et stimuler les défenses de l\'organisme. En dermatologie, l\'Eau Thermale de Vichy est aussi utilisée pour renforcer la tolérance cutanée et calmer les irritations', 75, 'https://www.boutika.co.ma/5782-home_default/vichy-eau-thermal.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2497-vichy-eau-thermal.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1340, 'SVR CLAIRIAL C10', '', 'SVR CLAIRIAL C10 Soin dépigmentant intense avec effet whitening (blanchissant) pour les taches brunes résistantes (masque de grossesse, taches de photosensibilisation..).Tous les types de peaux dont peaux \"ethniques\".', 265, 'https://www.boutika.co.ma/6048-home_default/svr-clairial-c10.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2582-svr-clairial-c10.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1341, 'URIAGE BEBE 1er Change', '', 'URIAGE BEBE 1er Change 75ml 1er Change protège l’épiderme fessier fragilisé de votre bébé et prévient au quotidien l’apparition des rougeurs. La peau de votre bébé est protégée, douce et hydratée.', 77, 'https://www.boutika.co.ma/8143-home_default/uriage-bebe-1er-change.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3381-uriage-bebe-1er-change.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1342, 'NUXE Aroma-Perfection Gel Nettoyant', '', 'Avec ses Tensio-actifs doux (huiles de Coton et de Coco, Dérivé de Jus de Pomme) et sa formule sans savon ni alcool, ce Gel Nettoyant Purifiant nettoie en douceur, désobstrue les pores et diminue l\'excès de sébum.Ce gel onctueux se transforme en une mousse fine et douce au contact de l\'eau.', 122, 'https://www.boutika.co.ma/23302-home_default/nuxe-aroma-perfection-gel-nettoyant-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8508-nuxe-aroma-perfection-gel-nettoyant-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1343, 'NUXE Crème Fraîche de Beauté Suractivée...', '', 'Un soin suractive le processus d\'hydratation naturelle au cœur des cellules 24H durant. Quel que soit leur âge, les peaux normales déshydratées sont ressourcées en continu et retrouvent leur fraîcheur.Désaltérée à nouveau, la peau défatiguée, déstressée redevient confortable, douce, souple et agréable à vivre. 8 Laits Végétaux, 5 Sèves Végétales hydratent...', 233, 'https://www.boutika.co.ma/23317-home_default/nuxe-creme-fraiche-de-beaute-suractivee-creme-hydratation-24h-peaux-seches-et-tres-seches.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8523-nuxe-creme-fraiche-de-beaute-suractivee-creme-hydratation-24h-peaux-seches-et-tres-seches.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1344, 'NUXE Crème Fraîche Sérum Hydratant et...', '', 'Un sérum anti-fatigue, véritable booster d’hydratation 24H grâce au Concept Aroma-Lacté®, à glisser sous toutes les crèmes, pour le visage et le contour des yeux.', 256, 'https://www.boutika.co.ma/23321-home_default/nuxe-creme-fraiche-serum-hydratant-et-apaisant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8527-nuxe-creme-fraiche-serum-hydratant-et-apaisant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1345, 'NUXE Crème Nirvanesque', '', 'Nuxe Crème Nirvanesque pour toute est un soin « douceur » pour oublier ses premières rides d’expression. Intensément relaxée, la peau est radieuse et s\'enveloppe d\'une sensation de bien-être extrême.La peau est immédiatement décrispée, délassée, lumineuse et très douce. Les ridules et les premières rides sont significativement réduites.', 275, 'https://www.boutika.co.ma/23322-home_default/nuxe-creme-nirvanesque-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8528-nuxe-creme-nirvanesque-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1346, 'NUXE Gelée Exfoliante Douce aux Pétales de...', '', 'Efficace par nature : Cette Gelée Exfoliante exfolie et élimine les cellules mortes tout en douceur.Des bienfaits précieux pour ma peau : Une texture gel aux grains exfoliants doux pour un grain de peau affiné. La peau est purifiée, douce et lisse, plus éclatante que jamais.Usage fréquent 75 ml', 160, 'https://www.boutika.co.ma/23332-home_default/nuxe-gelee-exfoliante-douce-aux-petales-de-rose.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8534-nuxe-gelee-exfoliante-douce-aux-petales-de-rose.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1347, 'Vichy Crème Moussante Purifiante Douceur', '', 'Vichy Pureté Thermale Crème Moussante Purifiante Douceur 125ml La peau est parfaitement nettoyée, fraîche et souple. Efficacité hydratante cliniquement démontrée.', 117, 'https://www.boutika.co.ma/5686-home_default/vichy-creme-moussante-purifiante-douceur.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2457-vichy-creme-moussante-purifiante-douceur.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1348, 'VICHY DEMAQUILLANT WATERPROOF YEUX SENSIBLES', '', 'VICHY DEMAQUILLANT WATERPROOF YEUX SENSIBLES 150ml Pour les femmes aux yeux sensibles. Convient aux porteuses de lentilles de contact. Le 1er Démaquillant Waterproof Yeux de Vichy qui prend soin des yeux sensibles.', 133, 'https://www.boutika.co.ma/17382-home_default/vichy-demaquillant-yeux-biphase.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2488-vichy-demaquillant-yeux-biphase.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1349, 'VICHY NEOVADIOL GF CONTOUR', '', 'VICHY NEOVADIOLGFCONTOURLEVRES/YEUX15MLEst un soin Densifieur Défroissant. Son Action Lissante est Immédiate pour une Redéfinition des Contours des Lèvres et des Yeux.', 204, 'https://www.boutika.co.ma/5860-home_default/vichy-neovadiol-gf-contour-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2523-vichy-neovadiol-gf-contour-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1350, 'Vichy Normaderm Hyaluspot 15 ml', '', 'Vichy Normaderm Hyaluspot Soin Ciblé Action Rapide Anti-Imperfections Anti-Marques 15ml Grâce à sa formule enrichie en acide hyaluronique et acide salicylique + LHA, ce soin unique offre un effet pansement + antibactérien pour protéger en surface tout en agissant contre les bactéries responsables de l\'apparition des boutons.Il aide donc à résorber...', 117, 'https://www.boutika.co.ma/5892-home_default/vichy-normaderm-hyaluspot-15-ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2538-vichy-normaderm-hyaluspot-15-ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1351, 'SVR CLAIRIAL CREME 10', '', 'SVR CLAIRIAL CREME 10 50ml Favorise la disparition des taches brunes étendues (Mélasma, masque de grossesse). Eclaire et uniformise le teint.Tous phototypes (caucasiens, asiatiques, ethniques).Hypoallergénique.', 273, 'https://www.boutika.co.ma/6050-home_default/svr-clairial-creme-10-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2583-svr-clairial-creme-10-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1352, 'DUCRAY Kelual DS', '', 'DUCRAY Kelual DS 40ml La crème Kélual D.S. est spécifiquement formulée pour le soin des peaux irritées présentant des squames, notamment au niveau du visage (sourcils, ailes du nez, lisière du cuir chevelu).Apaise rougeurs et irritations', 191, 'https://www.boutika.co.ma/7543-home_default/ducray-kelual-ds-40ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3139-ducray-kelual-ds-40ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1353, 'URIAGE BARIEDERM FISSURES, CREVASSES', '', 'URIAGE BARIEDERMFISSURES, CREVASSES L\'onguent isolant Bariéderm d\'Uriage répare, protége et assouplit les mains, pieds, coudes et genoux- qui souffrent de crevasses et de fissures.', 132, 'https://www.boutika.co.ma/8086-home_default/uriage-bariderm-fissures-crevasses-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3357-uriage-bariderm-fissures-crevasses-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1354, 'NUXE Crème Fraîche de Beauté Suractivée...', '', 'Un soin suractive le processus d\'hydratation naturelle au cœur des cellules 24H durant. Quel que soit leur âge, les peaux normales déshydratées sont ressourcées en continu et retrouvent leur fraîcheur.Désaltérée à nouveau, la peau défatiguée, déstressée redevient confortable, douce, souple et agréable à vivre. 8 Laits Végétaux, 5 Sèves Végétales hydratent...', 233, 'https://www.boutika.co.ma/23318-home_default/nuxe-creme-fraiche-de-beaute-suractivee-creme-hydratation-24h-peaux-seches-et-tres-seches.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8524-nuxe-creme-fraiche-de-beaute-suractivee-creme-hydratation-24h-peaux-seches-et-tres-seches.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43);
