(1355, 'Vichy Lotion Tonique PNM 200ml', '', 'Vichy Lotion Tonique PNM 200mlActive la respiration cellulaire et élimine les toxines.Débarrassée des toxines et parfaitement nettoyée, la peau respire librement. Elle retrouve fraîcheur, vitalité et éclat. Texture fluide apaisante.', 117, 'https://www.boutika.co.ma/5795-home_default/vichy-lotion-tonique-pnm-200ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2501-vichy-lotion-tonique-pnm-200ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
