(1357, 'VICHY LAIT DEMAQUILLANT PNM', '', 'VICHY LAIT DEMAQUILLANT PNM 200ml Lait Démaquillant Absolu Ultra-Douceur - Peaux Normales à Mixtes et Sensibles. Nettoie et libère la peau des impuretés et résidus de maquillage. Parfaitement démaquillée et nettoyée, la peau est libérée, nette et fraîche. Elle respire librement. Texture fraîche non grasse.', 117, 'https://www.boutika.co.ma/5900-home_default/vichy-lait-demaquillant-pnm.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2542-vichy-lait-demaquillant-pnm.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
(1358, 'VICHY Liftactiv CXP Yeux', '', 'VICHY Liftactiv CXP Yeux Soin anti-rides re-tenseur paupières.Relance la production intensive de fibres de collagène et d\'élastine.', 194, 'https://www.boutika.co.ma/6002-home_default/vichy-liftactiv-cxp-yeux.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2568-vichy-liftactiv-cxp-yeux.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 43),
