(1429, 'HEROME Dissolvant Soignant', '', 'HEROME Dissolvant Soignant Sans Acétone Le soin dissolvant Herôme ne contient pas d’acétone, ce qui évite la déshydratation des ongles. La composition est très douce et « légère ».Le D-Panthenol améliore l’élasticité de l’ongle, la lanoline prévient la déshydratation et donne une belle brillance à l’ongle.Le soin dissolvant Herôme est efficace et son...', 105, 'https://www.boutika.co.ma/21980-home_default/herome-dissolvant-soignant-sans-action.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2786-herome-dissolvant-soignant-sans-action.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1430, 'Vichy Dercos Shampooing Sans Sulfate', '', 'Vichy Dercos Shampooing Dermo-Apaisant Sans Sulfate Le Shampooing Traitant DERMO-APAISANT DERCOS des Laboratoires VICHY, apaise et soulage intensément les inconforts et les irritations des cuirs chevelus sensibles, tout en révélant la brillance et la douceur des cheveux', 98, 'https://www.boutika.co.ma/5657-home_default/vichy-dercos-shampooing-sans-sulfate.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2445-vichy-dercos-shampooing-sans-sulfate.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1431, 'PHYTOCOLOR 5 Chatin Clair', '', 'PHYTOCOLOR 5 Chatin Clair Couleur naturelle, cheveux doux et brillants, les femmes qui l\'utilisent ne changeraient pour rien au monde !', 119, 'https://www.boutika.co.ma/6295-home_default/phytocolor-5-chatin-clair.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2659-phytocolor-5-chatin-clair.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1432, 'HEROME System EasyDip Dissolvant', '', 'HEROME Dissolvant System EasyDip 60 ml Le système breveté HERÔME de nettoyage des ongles en un clin d’œil. Plus besoin de coton pour enlever le vernis de vos ongles. EASYDIP, grâce aux brosses en plastique doux qu’il contient et au dissolvant doux sans acétone, nettoie vos ongles rapidement même quand ils portent un vernis de couleur sombre résistante.', 139, 'https://www.boutika.co.ma/21982-home_default/herome-dissolvant-system-easy-dip.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2787-herome-dissolvant-system-easy-dip.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1433, 'HEROME Lime à Ongle 4 Phases', '', 'HEROME Lime à Ongle 4 Phases La lime à ongle quatre phases Herôme présente 4 zones différentes qui vous assurent un traitement complet de vos ongles. Elle permet de limer les ongles durs et moins durs,de lisser l’ongle et de le polir pour le faire briller. Elle est facile à utiliser et s’entretient très bien car elle est lavable.', 115, 'https://www.boutika.co.ma/6651-home_default/herome-kit-ongle-fort-lime.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2804-herome-kit-ongle-fort-lime.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1434, 'BIODERMA ECOPHANE 60 comprimé', '', 'BIODERMA ECOPHANE 60 comprimé ECOPHANE comprimés contient des actifs rigoureusement sélectionnés pour une efficacité optimale sur la qualité des phanères. Les hydrolysats de protéines végétales fortement concentré en acides aminés soufrés favorisent la formation de kératine.', 199, 'https://www.boutika.co.ma/7248-home_default/bioderma-ecophane-60-comprime.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3017-bioderma-ecophane-60-comprime.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1435, 'Vichy Dercos Shampooing Anti-Chute', '', 'Vichy Shampooing Aminexil Anti-Chute 200ml Pour les hommes et les femmes, qui connaissnt une chute des cheveux, légère à installée.Le seul shampooing à l\'Aminexil, la molécule cosmétique antichute de référence.Retrouvez des cheveux plus forts, plus vigoureux des racines jusqu\'aux pointes.', 109, 'https://www.boutika.co.ma/5677-home_default/vichy-shampooing-anti-chute.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2452-vichy-shampooing-anti-chute.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1436, 'PHYTOCOLOR 6AC Blond Foncé Acajou Cuivré', '', 'PHYTOCOLOR 6AC Blond Foncé Acajou Cuivré est un produit qui permet une coloration longue durée, couvrant les cheveux blancs dès la première application, tout en respectant la sensibilité de la fibre capillaire. Le soin protecteur après couleur nourrit la fibre capillaire en profondeur et apporte à la chevelure brillance et douceur.', 119, 'https://www.boutika.co.ma/6301-home_default/phytocolor-6ac-blond-fonce-acajou-cuivre.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2660-phytocolor-6ac-blond-fonce-acajou-cuivre.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1437, 'HEROME Durcisseur Doux pour ongles', '', 'HEROME Durcisseur Doux Pour Ongles Durcisseur pour ongles adapté aux personnes présentant des sensibilités aux produits cosmétiques car il ne contient ni formol ni résine TSF, mais des composants naturels comme la kératine et d\'autres protéines qui renforcent l\'ongle et ne sont pas du tout agressifs.', 169, 'https://www.boutika.co.ma/6595-home_default/herome-durcisseur-doux-pour-ongles.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2788-herome-durcisseur-doux-pour-ongles.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1438, 'HEROME Huile Nourrissante pour Ongles', '', 'HEROME Huile Nourrissante Les Ongles Améliore l\'état des ongles et des cuticules grâce à l\'huile d\'amande et de citron et aux vitamines E et F. Elle évite ainsi aux ongles de casser et de se fendre. Idéale pour les ongles secs et cassants, elle améliore leur croissance.', 142, 'https://www.boutika.co.ma/6625-home_default/herome-huile-nourrissante-les-ongles.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2796-herome-huile-nourrissante-les-ongles.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1439, 'BIODERMA SQUAPHANE MASQUE', '', 'BIODERMA SQUAPHANE MASQUE 100 ml Lemasque Squaphaneest indiqué pour éliminer les pellicules etétats squameux sévères en plaquedu cuir chevelu et du corps, ainsi que d\'apaiser lesirritations et démangeaisonsqui y sont associés.', 126, 'https://www.boutika.co.ma/7369-home_default/bioderma-squaphane-masque.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3071-bioderma-squaphane-masque.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1440, 'Vichy Dercos Shampooing Anti-Pelliculaires', '', 'Vichy Dercos Shampooing Anti-Pellicules Anti-Chutes 200ml Elimination des pellicules dès la 1ère semaine, grâce au Disulfure de Selenium.Efficacité anti-récidive jusqu\'à 4 semaines : la technologie anti-récidive permet le dépôt du sisulfure au niveau de la racine', 108, 'https://www.boutika.co.ma/5688-home_default/vichy-shampooing-anti-pelliculaires-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2458-vichy-shampooing-anti-pelliculaires-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1441, 'PHYTOCOLOR 6 Blond Fonce', '', 'PHYTOCOLOR 6 Blond Fonce 40ml Couleur naturelle, cheveux doux et brillants, les femmes qui l\'utilisent ne changeraient pour rien au monde !', 119, 'https://www.boutika.co.ma/6341-home_default/phytocolor-6-blond-fonce.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2662-phytocolor-6-blond-fonce.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1442, 'HEROME Durcisseur Extra Fort pour ongles', '', 'HEROME Durcisseur Extra Fort Ongles Durcisseur, très concentré, destiné aux personnes qui ont des ongles qui se cassent et se dédoublent très souvent. Après la cure de 15 jours, les ongles sont vraiment durs et ne se fendillent plus. A la suite de cette cure, il est conseillé pour l\'entretien d\'utiliser le durcisseur fort 1 à 2 fois par semaine.', 175, 'https://www.boutika.co.ma/6602-home_default/herome-durcisseur-extra-fort-ongles.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2790-herome-durcisseur-extra-fort-ongles.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1443, 'BIODERMA SQUAPHANE P', '', 'BIODERMA SQUAPHANE P 200 ml Squaphane P shampooing. kératorégulateur indiqué dans les états pelliculaires modérés associés à des démangeaisons du cuir chevelu...', 126, 'https://www.boutika.co.ma/7383-home_default/bioderma-squaphane-p-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3074-bioderma-squaphane-p-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45);
