(1444, 'HEROME BASE LISSANTE', '', 'HEROME BASE LISSANTE POUR ONGLES La base lissante rend vos ongles beaux et lisses. Elle peut également être utilisée comme vernis, et permet de prévenir la décoloration et la déshydratation des ongles. De plus, elle améliore la fixation des vernis colorés.', 110, 'https://www.boutika.co.ma/7972-home_default/herome-base-lissante-pour-ongles-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3310-herome-base-lissante-pour-ongles-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1445, 'Vichy Dercos Shampooing Anti-Pellicules', '', 'Vichy Dercos Shampooing Anti-Pelliculaires Pellicules Grasses 200ml Elimination des pellicules dès la 1ère semaine. Technologie anti récidive brevetée. Efficacité prolongée après arrêt du traitement.', 107, 'https://www.boutika.co.ma/5692-home_default/vichy-dercos-shampooing-anti-pellicules-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2460-vichy-dercos-shampooing-anti-pellicules-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
