(1447, 'HEROME Durcisseur FORT pour ongles', '', 'HEROME Durcisseur FORT pour ongles Ce durcisseur est destiné aux ongles mous, cassants et dédoublants. Il regroupe 4 fonctions : une base, une laque transparente, un fixateur et un durcisseur ! Les ongles deviennent plus durs et plus longs, et ne se dédoublent plus.', 175, 'https://www.boutika.co.ma/6604-home_default/herome-durcisseur-fort-pour-ongles.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2791-herome-durcisseur-fort-pour-ongles.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1448, 'BIODERMA SQUAPHANE S', '', 'BIODERMA SQUAPHANE S 125 ml États squameux sévères et irritations du cuir chevelu, en période de crise. Squames épaisses en plaques, démangeaisons', 119, 'https://www.boutika.co.ma/7379-home_default/bioderma-squaphane-s-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3076-bioderma-squaphane-s-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1449, 'Vichy Dercos Shampooing Anti-Pelliculaires', '', 'Vichy Dercos Shampooing Anti-Pelliculaires Pellicules Sèches 200 ml Elimination des pellicules dès la 1ère semaine, grâce au Disulfure de Selenium. Il enraye ainsi durablement la prolifération du micro-organisme, et donc le développement des pellicules. La fibre capillaire retrouve immédiatement brillance et tonicité', 106, 'https://www.boutika.co.ma/5705-home_default/vichy-dercos-shampooing-anti-pelliculaires.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2465-vichy-dercos-shampooing-anti-pelliculaires.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1450, 'PHYTOCOLOR 6D Blond Foncé Doré', '', 'PHYTOCOLOR 6D Blond Foncé Doré Couleur naturelle, cheveux doux et brillants, les femmes qui l\'utilisent ne changeraient pour rien au monde !', 119, 'https://www.boutika.co.ma/6315-home_default/phytocolor-6d-blond-fonce-dore.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2666-phytocolor-6d-blond-fonce-dore.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1451, 'HEROME Eau Emollient', '', 'HEROME Eau Emollient L\'eau émolliente Herôme ramollit les cuticules et élimine en douceur les petites peaux mortes. Permet de détacher sur vos ongles les petits filets de peau morte qui ne facilitent pas une belle pose de vernis et d\'amollir les cuticules qui deviennent ainsi élastiques et flexibles. Ceci améliore la croissance de l’ongle en facilitant le...', 127, 'https://www.boutika.co.ma/6616-home_default/herome-eau-emollient.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2793-herome-eau-emollient.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1452, 'Vichy Dercos Shampooing Anti-Pelliculaires...', '', 'Vichy Dercos Shampooing Anti-Pelliculaires Sensitive 200ml Le shampooing Dercos anti-pelliculaire sensitive permet d\'éliminer rapidement les pellicules grâce à sa composition en piroctone olamine qui traite le cuir chevelu et embellit la fibre. Il a une action anti récidive pendant 6 semaines', 104, 'https://www.boutika.co.ma/5707-home_default/vichy-dercos-shampooing-anti-pelliculaires-sensitive.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2466-vichy-dercos-shampooing-anti-pelliculaires-sensitive.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1453, 'PHYTOCOLOR 7 Blond', '', 'PHYTOCOLOR 7 Blond Couleur naturelle, cheveux doux et brillants, les femmes qui l\'utilisent ne changeraient pour rien au monde !', 119, 'https://www.boutika.co.ma/6317-home_default/phytocolor-7-blond.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2667-phytocolor-7-blond.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1454, 'HEROME Gel Hydratant Pour Ongles', '', 'HEROME Gel Hydratant Pour Les Ongles Le gel hydratant nourrit et hydrate l\'ongle pour le rendre plus flexible avec une brillance naturelle. Il est aussi rafraichissant, prévient la déshydratation et peut être appliqué fréquemment.', 143, 'https://www.boutika.co.ma/6751-home_default/herome-gel-hydratant-pour-les-ongles.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2795-herome-gel-hydratant-pour-les-ongles.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1455, 'Vichy Dercos Shampooing Crème Nutritif', '', 'Vichy Dercos Shampooing Crème Nutritif Reparateur 200ml Cheveux secs, abîmés et cassants.Céramide reconstituant. Répare et nourrit la fibre capillaire. Brillance, douceur et souplesse.Shampooing au collagène. Anti-déssèchement longue durée. Brillance, douceur et force.', 100, 'https://www.boutika.co.ma/5712-home_default/vichy-dercos-shampooing-creme-nutritif.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2469-vichy-dercos-shampooing-creme-nutritif.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1456, 'PHYTOCOLOR 7D Blond Doré', '', 'PHYTOCOLOR 7D Blond Doré Couleur naturelle, cheveux doux et brillants, les femmes qui l\'utilisent ne changeraient pour rien au monde !', 119, 'https://www.boutika.co.ma/6345-home_default/phytocolor-7d-blond-dore.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2669-phytocolor-7d-blond-dore.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1457, 'Vichy Dercos Shampooing Dermo-Apaisant', '', 'Vichy Dercos Shampooing Dermo-Apaisant 200ml - Apaise dès le premier shampooing et calme les sensations d\'inconfort du cuir chevelu sensible.- Réduit des démangeaisons après trois applications. - Apporte plus de brillance et de souplesse aux cheveux.', 98, 'https://www.boutika.co.ma/5717-home_default/vichy-dercos-shampooing-dermo-apaisant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2471-vichy-dercos-shampooing-dermo-apaisant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1458, 'Vichy Dercos Shampooing Energisant', '', 'Vichy Dercos Shampooing Energisant 200ml Le Shampooing Dercos Energisant est un shampooing luttant contre la chute des cheveux en les rendants plus forts et plus vigoureux, ils sont vitalisés de la racine à la pointe', 100, 'https://www.boutika.co.ma/5726-home_default/vichy-dercos-shampooing-energisant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2474-vichy-dercos-shampooing-energisant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1459, 'PHYTOCOLOR 8 Blond Clair', '', 'PHYTOCOLOR 8 Blond Clair Couleur naturelle, cheveux doux et brillants, les femmes qui l\'utilisent ne changeraient pour rien au monde !', 119, 'https://www.boutika.co.ma/6331-home_default/phytocolor-8-blond-clair.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2672-phytocolor-8-blond-clair.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1460, 'HEROME Manucure en 1 Minute', '', 'HEROME Manucure En 1 Minute One minute Manucure enlève les cellules mortes et active la production de nouvelles cellules. Le gommage active la circulation sanguine et récupère l’équilibre de la peau. Herôme one minute manucure assure une hydratation profonde et procure une sensation agréable de mains douces et soyeuses.', 215, 'https://www.boutika.co.ma/6658-home_default/herome-manucure-en-1-minute.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2806-herome-manucure-en-1-minute.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1461, 'Vichy Dercos Shampooing Sebo Correcteur', '', 'Vichy Dercos Shampooing Sebo Correcteur 200 ml Son complexe Anti-Sébum provient de l\'association exclusive de 4 tensio-actifs spécifiquement sélectionnés et justement dosés pour limiter la migration de sébum sur la fibre capillaire et ainsi préserver l\'intégrité du cuir chevelu et retarder le graissage. Retrouvez des cheveux légers, faciles à coiffer', 100, 'https://www.boutika.co.ma/5731-home_default/vichy-dercos-shampooing-sebo-correcteur.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2476-vichy-dercos-shampooing-sebo-correcteur.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
(1462, 'PHYTOCOLOR 8CD', '', 'PHYTOCOLOR 8CD Phyto Color, une ligne de 16 crèmes colorantes pour cheveux. Les cheveux blancs sont couverts à 100 % et pendant longtemps. Ces soins respectent la fibre du cheveu et le cuir chevelu.', 119, 'https://www.boutika.co.ma/6333-home_default/phytocolor-8cd.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2674-phytocolor-8cd.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 45),
