(1510, 'AVENT TROUSSE DE PREMIERS SOINS POUR BÉBÉ', '', 'Avent Trousse de premiers soins pour bébéTous les produits de soin essentiels pour bébé dans une trousse complèteChouchoutez votre bébé avec cette trousse de soin complète : un thermomètre digital rapide et efficace, un mouche-bébé à embout flexible, un doigt de massage des gencives, un kit de manucure et un pour les cheveux.', 483, 'https://www.boutika.co.ma/20935-home_default/avent-trousse-de-premiers-soins-pour-bebe.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7719-avent-trousse-de-premiers-soins-pour-bebe.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1511, 'AVENT TASSE MAUVE AVEC ANSES ROUGES 200ML 6M+', '', 'La tasse magic avec anses Avent a une efficacité anti-fuites optimale tout en restant très facile à utiliser pour votre enfant. , elle convient aux poussées dentaires. Elle permet à votre bébé de boire facilement, grâce à sa valve qui contrôle le débit. Dotée d\'un capuchon déclic, la tasse magic est idéale en déplacements ! Les becs à valve peuvent...', 104, 'https://www.boutika.co.ma/20936-home_default/avent-tasse-mauve-avec-anses-rouges-200ml-6m.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7720-avent-tasse-mauve-avec-anses-rouges-200ml-6m.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
