(1513, 'AVENT COUSSINETS D\'ALLAITEMENT JETABLES...', '', 'Avent Coussinet Jetable. Les coussinets d’allaitement jetables d’AVENT permettent de recueillir les quelques gouttes de lait qui couleront encore après une tétée et celles qui filtreront aussi lorsque vos seins se gorgeront de lait.', 150, 'https://www.boutika.co.ma/20959-home_default/avent-coussinets-d-allaitement-jetables-ultra-confort-x60.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7736-avent-coussinets-d-allaitement-jetables-ultra-confort-x60.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1514, 'AVENT 2 BECS SOUPLES MAGIC', '', 'Les becs Magic s\'adaptent aux tasses Magic et biberons AVENT pour les rendre anti-fuites. La valve brevetée Avent Magic fléchit pour laisser l\'air rentrer dans la tasse ou le biberon et remplacer le vide. L\'enfant obtient ainsi un débit continu de liquide, avec un minimum d\'effort.', 52, 'https://www.boutika.co.ma/20960-home_default/avent-doseur-de-lait-en-poudre.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7737-avent-doseur-de-lait-en-poudre.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
