(1518, 'AVENT PETIT BOL 6 M+ POUR QUE VOTRE ENFANT...', '', 'Pour les premiers repas de votre bébé et pour qu\'il apprenne à manger seul et en s\'amusant.Une solution pour accompagner la croissance de votre enfant.', 101, 'https://www.boutika.co.ma/20967-home_default/avent-petit-bol-6-m-pour-que-votre-enfant-apprenne-a-manger-tout-en-s-amusant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7742-avent-petit-bol-6-m-pour-que-votre-enfant-apprenne-a-manger-tout-en-s-amusant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1519, 'AVENT SET DE COUVERTS 12 M+ CUILLÈRE -...', '', 'Ce set de deux couverts \"Lapin\" 2ème âge de la marque Philips Avent encouragera bébé à bien manger tout en s\'amusant. Cette cuillère et cette fourchette ont étés spécialement conçues pour apprendre à manger seul. La prise en main est adaptée aux tout-petits; ce qui rend ces couverts idéals pour manger seul.', 74, 'https://www.boutika.co.ma/20968-home_default/avent-set-de-couverts-12-m-cuillere-fourchette.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7743-avent-set-de-couverts-12-m-cuillere-fourchette.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1520, 'AVENT SET REPAS 6 M+ 1 ASSIETTE - 2 BOLS -...', '', 'Un coffret complet spécialement conçu pour apprendre à manger seul tout en s’amusant, grâce au récit d\'histoires drôles autour du thème de la nutrition. Prise en main adaptée aux tout-petits : idéal pour manger seul.', 374, 'https://www.boutika.co.ma/20970-home_default/avent-set-repas-6-m-1-assiette-2-bols-1-fourchette-1-cuillere.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/7745-avent-set-repas-6-m-1-assiette-2-bols-1-fourchette-1-cuillere.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
