(1534, 'AVENT Coquilles Comfort Isis', '', 'AVENT Coquilles Comfort Isis Elles se portent dans le soutien-gorge pour protéger les mamelons endoloris, soulager les engorgements ou recueillir du lait.', 162, 'https://www.boutika.co.ma/6963-home_default/avent-coquilles-comfort-isis.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2913-avent-coquilles-comfort-isis.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1535, 'AVENT Crème Mamelons Sensible', '', 'AVENT Crème Mamelons Sensible 30ml Crème mamelons sensibles 30ml, pour hydrater et soulager les seins secs, crevassés ou gercés. Riche en aloe vera et en lanoline médicale pure hypoallergénique, inutile de l\'enlever avant la tétée. Avent, pour le Bien-être des Mamans, pour le Bien-être des enfants.', 142, 'https://www.boutika.co.ma/6965-home_default/avent-creme-mamelons-sensible-30ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2914-avent-creme-mamelons-sensible-30ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1536, 'AVENT Cuillères De Sevrage 6+', '', 'AVENT Cuillères De Sevrage 6+ Une solution pour accompagner les différentes étapes de la croissance de votre enfant. Ces cuillères de sevrage sont spécialement conçues pour que votre enfant apprenne à manger seul. Sans BPA. Nettoyage au lave-vaisselle', 83, 'https://www.boutika.co.ma/6967-home_default/avent-cuilleres-de-sevrage-6.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2916-avent-cuilleres-de-sevrage-6.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1537, 'AVENT Dect Eco Baby Monitor', '', 'AVENT Dect Eco Baby Monitor Le Baby Monitor Eco Dect de la marque Philips Avent est équipé de communication à 2 voies pour que la maman puisse tranquilliser le bébé par sa voix. Il est possible aussi de choisir des mélodies de berceuse pour le faire relaxer et en favoriser le sommeil. Veilleuse diffuse.', 1548, 'https://www.boutika.co.ma/6998-home_default/avent-dect-eco-baby-monitor.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2925-avent-dect-eco-baby-monitor.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1538, 'AVENT Doseur De Lait en Poudre', '', 'AVENT De Lait En Poudre Doseur de lait en poudre Se transforme en petit bol lorsque le compartiment intérieur est retiré. Spécifications : Peut contenir 3 doses de poudre : pour la préparation de 3 biberons à l\'avance. - Couvercle hermétique : aucune migration de poudre.', 92, 'https://www.boutika.co.ma/7005-home_default/avent-de-lait-en-poudre.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2927-avent-de-lait-en-poudre.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1539, 'AVENT Express Bottle Warmer', '', 'AVENT Express Bottle Warmer AVENT express bottèle warmerr à une température parfaite en quelques minutes, sans points chauds ou des brûlures. Philips Avent aliments et chauffe-biberon: chauffe rapidement et uniformément Le moyen rapide et sûr de se réchauffer le lait exprimé et les aliments pour bébé, la bouteille électrique.', 617, 'https://www.boutika.co.ma/7007-home_default/avent-express-bottle-warmer.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2928-avent-express-bottle-warmer.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1540, 'AVENT Goupillons', '', 'AVENT Goupillons Brosse à bout recourbé pour nettoyage méticuleux de toutes les formes de biberon, avec nettoie-tétine intégré au manche. Ses poils, serrés, sont suffisamment rigides pour décoller les restes d\'aliments, et assez souples pour ne pas rayer ni abîmer les biberons, tétines.', 41, 'https://www.boutika.co.ma/7009-home_default/avent-goupillons.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2929-avent-goupillons.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1541, 'AVENT Kit Nouveau-Né', '', 'AVENT Kit Nouveau-né Le kit nouveau-né Avent est un kit complet de biberons 0% BPA spécialement conçu pour diminuer l\'irritabilité de votre bébé surtout la nuit.', 404, 'https://www.boutika.co.ma/7011-home_default/avent-kit-nouveau-ne.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2930-avent-kit-nouveau-ne.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1542, 'AVENT Lot 2Biberon 260ml', '', 'AVENT Lot 2Biberon 260ml Dotés de la nouvelle tétine souple, très douce et aux alvéoles de confort uniques, conçue pour que bébé tète naturellement, comme au sein.', 174, 'https://www.boutika.co.ma/7013-home_default/avent-lot-2biberon-260ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2931-avent-lot-2biberon-260ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1543, 'MUSTELA Baume Reconfortant', '', 'MUSTELA Baume Reconfortant 40ml Dès les premièrs mois, les agressions climatiques peuvent provoquer des refroidissements, sensations d\'encombrement, perturbant le confort et le sommeil de votre bébé.', 70, 'https://www.boutika.co.ma/7017-home_default/mustela-baume-reconfortant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2933-mustela-baume-reconfortant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1544, 'MUSTELA Cold Crème', '', 'MUSTELA Cold Crème 40ml Mustela Cold Cream crème ultra-protectrice protège la peaucontre les agressions extérieures, telles que le froid, le vent,....grâce notamment à l’effet bouclier remarquable de la cired’abeille.', 43, 'https://www.boutika.co.ma/7019-home_default/mustela-cold-creme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2934-mustela-cold-creme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
(1545, 'AVENT TIRE-LAIT ELECTRIQUE', '', 'AVENT Single Breast Pump UK Plug Le tire-lait électronique unique offre la technologie la plus avancée en matière de confort et de contrôle dans une mini, encore puissante pompe. Les tire-laits Philips AVENT sont quelques-unes des premières pompes qui imitent l\'action de l\'allaitement naturel des bébés.', 1918, 'https://www.boutika.co.ma/7021-home_default/avent-single-breast-pump-uk-plug.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2935-avent-single-breast-pump-uk-plug.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 46),
