(1553, 'MUSTELA Stelactiv Soin D\'epiderme fessier', '', 'MUSTELLA Stelactiv Soin D\'epiderme fessier 75ml Mustela Stelactiv est un soin dermo-réparateur complet spécifiquement adapté aux rougeurs du siège du nourrisson et du bébé : rougeurs non suintantes modérées ou installées.', 70, 'https://www.boutika.co.ma/7105-home_default/mustella-stelactiv-soin-d-epiderme-fessier.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2974-mustella-stelactiv-soin-d-epiderme-fessier.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 47),
(1554, 'AVENE Cicalfate Lotion', '', 'AVENE Cicalfate Lotion 40ml Cette lotion est particulièrement adaptée aux peaux sensibles, irritées et suintantes de l\'adulte, de l\'enfant et du nourrisson. Très riche en Eau thermale d\'Avène aux propriétés apaisantes et anti-irritantes, Cicalfate lotion calme les irritations cutanées qui accompagnent les lésions suintantes, et elle apaise les épidermes...', 129, 'https://www.boutika.co.ma/7224-home_default/avene-cicalfate-lotion-40ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3005-avene-cicalfate-lotion-40ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 47),
