(1556, 'DUCRAY Diaseptyl Solution Aqueuse', '', 'DUCRAY Diaseptyl Solution Aqueuse 125ml Soin antibactérien, il ne pique pas (ne contient pas d\'alcool), ne colore ni la peau ni les vêtements, et peut être utilisé sur les peaux fragiles.', 52, 'https://www.boutika.co.ma/7508-home_default/ducray-diaseptyl-solution-aqueuse-125ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3123-ducray-diaseptyl-solution-aqueuse-125ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 47),
