(1558, 'DUCRAY Gel Moussant au Lait d’Avoine Rhealba', '', 'DUCRAYGel Moussant au Lait d’Avoine Rhealba 250ml Ducray A-Derma Gel Moussant Avoine est un gel nettoyant moussant au lait d\'avoine Rhealba. Nettoie l\'épiderme sans l\'agresser. Apaise et adoucit la peau. Respecte le film hydrolipidique, protège du déssèchement cutané.Toilette visage et corps des peaux irritées et réactives, des bébés et des enfants, des...', 93, 'https://www.boutika.co.ma/7514-home_default/ducray-gel-moussant-lait-avoine-rhealba-250ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3126-ducray-gel-moussant-lait-avoine-rhealba-250ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 47),
