(1561, 'LA ROCHE POSAY Anthelios XL Lait', '', 'LA ROCHE POSAY Anthelios XL Lait 100ml Formulé avec les filtres Mexoryl SX et XL pour assurer une protection large et photostable contre les UVB/UVA, il prévient la peau des dommages cutanés à long terme liés aux UVA et du masque de grossesse.Texture hydratante et fondante, sans paraben, résiste à l\'eau.', 201, 'https://www.boutika.co.ma/7920-home_default/la-roche-posay-anthelios-xl-lait-100ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3290-la-roche-posay-anthelios-xl-lait-100ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 47),
