(1599, 'NUXE Aroma-Perfection Lotion Purifiante...', '', 'Une lotion ultra-fraîche, non collante qui resserre les pores et matifie, pour une peau instantanément plus nette.Cette lotion possède une double action complète : purifiante et perfectrice de peau. La peau est nette et purifiée, le grain de peau est affiné à 100%*. Le teint est clarifié à 95% RESSERRE LES PORES, MATIFIEPeaux mixtes et grasses', 135, 'https://www.boutika.co.ma/23303-home_default/nuxe-aroma-perfection-lotion-purifiante-perfectrice.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8509-nuxe-aroma-perfection-lotion-purifiante-perfectrice.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1600, 'NUXE Aroma-Perfection Gel Nettoyant', '', 'Avec ses Tensio-actifs doux (huiles de Coton et de Coco, Dérivé de Jus de Pomme) et sa formule sans savon ni alcool, ce Gel Nettoyant Purifiant nettoie en douceur, désobstrue les pores et diminue l\'excès de sébum.Ce gel onctueux se transforme en une mousse fine et douce au contact de l\'eau.', 122, 'https://www.boutika.co.ma/23302-home_default/nuxe-aroma-perfection-gel-nettoyant-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8508-nuxe-aroma-perfection-gel-nettoyant-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1601, 'Vichy Gel de Rasage PS', '', 'Vichy Gel de Rasage PS L\'association du Calcium, de la Vitamine C glucosylée et de l\'Acide salicylique prévient votre peau des échauffements qui peuvent subvenir au cours du rasage. Elle préserve le film hydrolipidique cutané évitant sensations de frottement et irritations. Votre peau est protégée, hydratée en profondeur', 117, 'https://www.boutika.co.ma/5790-home_default/vichy-gel-de-rasage-ps.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2499-vichy-gel-de-rasage-ps.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1602, 'VICHY GEL DOUCHE MAG-C', '', 'VICHY GEL DOUCHE MAG-C 200ml L\'association de Magnésium et de Vitamine C glucosylée recharge votre peau en énergie.Votre corps paraît dynamisé, votre peau est hydratée, pour une journée au confort extrême', 107, 'https://www.boutika.co.ma/5793-home_default/vichy-gel-douche-mag-c-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2500-vichy-gel-douche-mag-c-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1603, 'Vichy Homme Hydra Mag-C', '', 'Vichy Homme Hydra Mag-C 50ml Protège le visage 24 heures. Contient UVB et UVA protection des rayons solaires. Hydrate la peau. Cette crème est adaptée pour chaque type de peau des hommes. Le mieux est d’appliquer la crème le matin ou le soir si vous planifiez pour une longue nuit.', 157, 'https://www.boutika.co.ma/5796-home_default/vichy-homme-hydra-mag-c.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2502-vichy-homme-hydra-mag-c.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1604, 'VICHY Homme Liftactiv', '', 'VICHY Homme Liftactiv Visage 30ml Soin actif anti-rides, anti-fatigue - rides et ridules réduites, peau lissée et défatiguée. Liftactiv à l\'acide hyaluronique, combleur de référence + AHA pour revitaliser la peau.Hydratation 24HImmédiatement, la peau est lissée. Dés 8 jours, les rides se réduisent.Revitalisée, la peau est visiblement défatiguée.', 202, 'https://www.boutika.co.ma/6006-home_default/vichy-homme-liftactiv-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2569-vichy-homme-liftactiv-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1605, 'VICHY Homme Liftactiv Yeux', '', 'VICHY Homme Liftactiv Yeux Pour les hommes, à la peau sensible, présentant des rides et des marques de fatigue autour des yeux : poches et cernes.L\'embout applicateur effet massage active la microcirculation cutanée à chaque application. Votre regard retrouve toute sa fraîcheur', 198, 'https://www.boutika.co.ma/6009-home_default/vichy-homme-liftactiv-yeux.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2570-vichy-homme-liftactiv-yeux.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1606, 'LIERAC Homme Anti-Fatigue', '', 'LIERAC Homme Anti-Fatigue Gel-Crème Hydratant Revitalisant 50ml Très frais, ce gel-crème déclenche le réveil cellulaire et aide la peau à produire sa propre source d’énergie pour combattre les marques de stress et de fatigue.La bonne mine réapparaît, la peau est comme réveillée, en pleine forme', 240, 'https://www.boutika.co.ma/6145-home_default/lierac-homme-anti-fatigue.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2609-lierac-homme-anti-fatigue.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1607, 'LIERAC Homme Anti-Rides', '', 'LIERAC Homme Anti-Rides 50ml Ultra-concentré en complexe pro-vitaminé 5 % (rétinol pur micro-encapsulé + vitamine C + pro-vitamine D) dont l’efficacité restructurante n’est plus à démontrer, ce fluide relance les systèmes de production de collagène et de réparation de l’épiderme pour prévenir l’apparition et réduire visiblement l\'aspect des signes de...', 299, 'https://www.boutika.co.ma/6157-home_default/lierac-homme-anti-rides.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2612-lierac-homme-anti-rides.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1608, 'Vichy Homme Mousse à Raser', '', 'Vichy Homme Mousse à Raser PS 200 ml Indication : Tous types de peaux. Utilisation : Matin et ou soir, en association avec le gel frais hydratant.', 109, 'https://www.boutika.co.ma/5806-home_default/vichy-homme-mousse-a-raser.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2506-vichy-homme-mousse-a-raser.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1609, 'Vichy Normaderm Gel Exfoliant', '', 'Vichy Normaderm Gel ExfoliantPour les hommes et les femmes de tout âge qui veulent lisser le grain de la peau en le débarrassant des cellules mortes en surface.', 126, 'https://www.boutika.co.ma/5878-home_default/vichy-normaderm-gel-exfoliant-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2532-vichy-normaderm-gel-exfoliant-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1610, 'LIERAC Baume Après-Rasage Apaisant', '', 'LIERAC Baume Après-Rasage Apaisant 75ml Lierac Baume Apaisant Après Rasage Hydratant Anti-Irritations. Sans alcool, ce baume frais contient un extrait de feuilles de menthe poivrée secondé par un extrait de calendula adoucissant pour stopper net le feu du rasoir, calmer en continu les sensations de tiraillements et apaiser les irritations', 180, 'https://www.boutika.co.ma/6271-home_default/lierac-baume-apres-rasage-apaisant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2647-lierac-baume-apres-rasage-apaisant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1611, 'LIERAC Gel de Rasage Homme', '', 'LIERAC Gel de Rasage Homme 150ml Le GEL DE RASAGE CONFORT des Laboratoires LIERAC HOMME, est un soin hydratant et protecteur, qui réduit les irritations au moment du rasage en facilitant le passage de la lame.', 100, 'https://www.boutika.co.ma/6291-home_default/lierac-gel-de-rasage-homme-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2657-lierac-gel-de-rasage-homme-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1612, 'LIERAC Homme Déodorant', '', 'LIERAC Homme Déodorant Agents anti-transpirant et anti-odeur;Prêle, Sauge, Menthe, Citron. Ultra complet, ce déodorant garantit une sensation de bien-être tout au long de la journée : La sensation d’humidité et les odeurs sont estompées. La peau reste sèche et fraîche durant 24h.', 100, 'https://www.boutika.co.ma/6351-home_default/lierac-homme-deodorant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2679-lierac-homme-deodorant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1613, 'LIERAC Homme Déodorant', '', 'LIERAC Homme Déodorant Agents anti-transpirant et anti-odeur;Prêle, Sauge, Menthe, Citron. Ultra complet, ce déodorant garantit une sensation de bien-être tout au long de la journée : La sensation d’humidité et les odeurs sont estompées. La peau reste sèche et fraîche durant 24h.', 100, 'https://www.boutika.co.ma/6353-home_default/lierac-homme-deodorant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2680-lierac-homme-deodorant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1614, 'LIERAC Gel Bronzage Crème Fraicheur', '', 'LIERAC Gel Bronzage Crème Fraicheur IP10 40ml Enrichi en épices ultra bronzantes et en figue de barbarie réparatrice, ce gel-crème solaire ultra frais assure un bronzage plus intense et plus rapide, tout en protégeant la peau des UVA et des UVB. Sa texture non grasse est idéale pour les peaux mixtes et brillantes ainsi que pour celle des hommes.', 199, 'https://www.boutika.co.ma/6287-home_default/lierac-gel-bronzage-creme-fraicheur-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2655-lierac-gel-bronzage-creme-fraicheur-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1615, 'LIERAC Homme Gel Douche Intégral', '', 'LIERAC Homme Gel Douche Intégral 200 ml Ce Gel DOUCHE Homme est conçu à base de 5 minéraux et vitamines. Soin enrichi pour un effet doux et fortifiant : - Guarana- Citron- Menthe- Ginseng', 107, 'https://www.boutika.co.ma/6362-home_default/lierac-homme-gel-douche-integral-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2682-lierac-homme-gel-douche-integral-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1616, 'LIERAC Homme Premium Fluide', '', 'LIERAC Homme premium fluide 40ml Le fluide Premium anti-âge pour Homme de Lierac comble les rides. Anti-rides, Anti-fatigue, Apaisant.Des rides comblées, une peau lisse & plus ferme. Une atténuation des signes de fatigue cutanée & un effet bonne-mine. Ue peau parfaitement apaisée & hydratée dès l’application', 387, 'https://www.boutika.co.ma/6368-home_default/lierac-homme-premium-fluide-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2684-lierac-homme-premium-fluide-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1617, 'LIERAC Homme Rasage Express', '', 'LIERAC Homme Rasage Express 150ml Onctueuse, cette mousse de rasage assure une glisse de la lame incomparable et une protection optimale de la peau. La présence d\'extrait de menthe poivrée riche en polyphénols estompe les sensations d\'irritations et apaise la peau. Plus de glisse, moins d\'irritations.', 93, 'https://www.boutika.co.ma/6374-home_default/lierac-homme-rasage-express-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2687-lierac-homme-rasage-express-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1618, 'LIERAC Gel Moussant Visage Homme', '', 'LIERAC Gel Moussant Visage Homme100ml Ce nettoyant purifiant Liérac Homme est un gel moussant micro-exfoliant pour le visage. Utilisé au quotidien, il purifie et facilite le rasage.', 160, 'https://www.boutika.co.ma/6327-home_default/lierac-gel-moussant-visage-homme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2671-lierac-gel-moussant-visage-homme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1619, 'AVENE Baume Apres Rasage', '', 'AVENE Baume Apres Rasage 75ml Le Baume après rasage AVENE est un soin après rasage particulièrement conseillé pour les peaux sensibles à tendance sèche.', 124, 'https://www.boutika.co.ma/7195-home_default/avene-baume-apres-rasage-75ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3002-avene-baume-apres-rasage-75ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1620, 'DUCRAY Baume Après Rasage', '', 'DUCRAY Baume Après Rasage 50ml Les Laboratoires Dermatologiques Ducray ont élaboré une gamme de soins spécifiques pour les hommes, qui garantit un rasage en toute sécurité même pour les barbes les plus difficiles.', 91, 'https://www.boutika.co.ma/7504-home_default/ducray-baume-apres-rasage-50ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3120-ducray-baume-apres-rasage-50ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48);
INSERT INTO `products` (`id`, `libProduct`, `slug`, `descProduct`, `priceProduct`, `imgProduct`, `numSeller`, `src`, `urlProduct`, `logo`, `origin`, `subcategory_id`) VALUES
(1621, 'BIODERMA HYFAC MOUSSE PLUS', '', 'BIODERMA HYFAC MOUSSE PLUS 150 ml La mousse à raser Hyfac est spécialement formulée pour les peaux jeunes à problèmes. Elle prévient les phénomènes irritatifs pour un rasage en douceur.', 106, 'https://www.boutika.co.ma/7272-home_default/bioderma-hyfac-mousse-plus.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3029-bioderma-hyfac-mousse-plus.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1622, 'SVR Spirial Crème Anti Transpirant', '', 'SVR Spirial Creme Anti Transpirant 50ml La crème Spirial des laboratoires SVR est indiquée pour réduire et freiner la transpiration excessive des aisselles, mais aussi des pieds, des mains, des plis, du visage ou de toute autre partie du corps victime de transpiration.', 116, 'https://www.boutika.co.ma/7460-home_default/svr-spirial-creme-anti-transpirant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3101-svr-spirial-creme-anti-transpirant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1623, 'SVR Spirial Spray Anti-Transpirant', '', 'SVR Spirial Spray Anti-Transpirant 100ml Le déodorant Spray Spirial SVR est indiqué pour limiter la transpiration des aisselles, et convient pour la peau sensible. Ce déodorant est recommandé en cas de transpiration excessive.', 104, 'https://www.boutika.co.ma/7464-home_default/svr-spirial-spray-anti-transpirant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3103-svr-spirial-spray-anti-transpirant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1624, 'SVR Spirial Gel Anti-Transpirant', '', 'SVR Spirial Gel Anti-Transpirant 200ml Le gel moussant déodorant Spirial des laboratoires SVR est un gel douche indiqué pour nettoyer en douceur la peau sensible et pour limiter la formation d\'odeurs corporelles désagréables (transpiration des aisselles, des pieds, des mains, des plis, du visage ou encore du cuir chevelu).', 89, 'https://www.boutika.co.ma/7462-home_default/svr-spirial-gel-anti-transpirant.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3102-svr-spirial-gel-anti-transpirant.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1625, 'SVR Topialyse Crème Palpébral', '', 'SVR Topialyse Crème Palpébral 10ml La crème palpébral Topialyse des laboratoires SVR est indiquée pour hydrater, apaiser et décongestionner les paupières irritées, sensibilisées et gonflées par une peau atopique ou par une réaction allergique (pollen par exemple). Elle convient à l\'adulte, à l\'enfant et au nourrisson.', 108, 'https://www.boutika.co.ma/7471-home_default/svr-topialyse-creme-palpebral.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3106-svr-topialyse-creme-palpebral.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1626, 'SVR Topialyse Huile De Bain', '', 'SVR Topialyse Huile De Bain L\'huile de bain Tolialyse des laboratoires SVR est un produit nettoyant pour peaux sèches, nourrir et réduire les irritations et inconforts de la peau sèche et/ou atopique. Elle convient pour la toilette quotidienne de l\'adulte, de l\'enfant et du nourrisson.', 141, 'https://www.boutika.co.ma/7473-home_default/svr-topialyse-huile.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3107-svr-topialyse-huile.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1627, 'SVR Xerail 10 Crème Pieds Secs', '', 'SVR Xerail 10 Crème Pieds Secs 100ml La crème pieds Xérial 10 des laboratoires SVR est indiquée pour l\'hydratation intense de la peau sèche des pieds, pour assouplir et pour nourrir les pieds secs.', 105, 'https://www.boutika.co.ma/7482-home_default/svr-xerail-10-creme-pieds-secs-100ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3110-svr-xerail-10-creme-pieds-secs-100ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1628, 'SVR Xerail 30 Crème Pieds Très Secs', '', 'SVR Xerail 30 Crème Pieds Très Secs 100ml La crème pieds Xérial 30 des laboratoires SVR est indiquée pour l\'hydratation, la réparation des pieds très secs et abimés, et pour la prévention de l\'apparition de callosités.', 146, 'https://www.boutika.co.ma/7484-home_default/svr-xerail-30-creme-pieds-secs-100ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3111-svr-xerail-30-creme-pieds-secs-100ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1629, 'SVR Xérial 50 Crème Pieds', '', 'SVR Xérial 50 Crème Pieds 50ml La crème Xérial 50 est indiquée pour les pieds en cas de callosités ou de durillons.', 112, 'https://www.boutika.co.ma/7492-home_default/svr-xerial-50-creme-pieds-50ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3115-svr-xerial-50-creme-pieds-50ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1630, 'SVR Provegol Shampooing Extra Doux', '', 'SVR Provegol Shampooing Extra Doux 200ml Shampooing usage fréquent, convient à tous les types de cheveux et est recommandé en relais des shampooings traitants.', 94, 'https://www.boutika.co.ma/7739-home_default/svr-provegol-shampooing-extra-doux.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3213-svr-provegol-shampooing-extra-doux.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1631, 'SVR RUBIALINE CRÈME', '', 'SVR RUBIALINE CRÈME 40ml SVR Rubialine Crème atténue l’intensité des rougeurs et limite leur réapparition. Sa texture légère et non grasse procure dès son application un soulagement immédiat et une sensation d’apaisement. RUBIALINE Crème garantit une très bonne tolérance sur les peaux les plus sensibles.', 159, 'https://www.boutika.co.ma/7741-home_default/svr-rubialine-creme.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3214-svr-rubialine-creme.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1632, 'DUCRAY Diaseptyl Solution Aqueuse', '', 'DUCRAY Diaseptyl Solution Aqueuse 125ml Soin antibactérien, il ne pique pas (ne contient pas d\'alcool), ne colore ni la peau ni les vêtements, et peut être utilisé sur les peaux fragiles.', 52, 'https://www.boutika.co.ma/7508-home_default/ducray-diaseptyl-solution-aqueuse-125ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3123-ducray-diaseptyl-solution-aqueuse-125ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
(1633, 'DUCRAY Diaseptyl Spray', '', 'DUCRAY Diaseptyl Spray 125ml Ducray Diaseptyl Spray est une solution anti-bactérienne à la chlorhexidine, incolore, ne pique pas, ne tache ni la peau, ni les vêtements. Diaseptyl spray peut être utilisé sur les peaux fragiles. Soin assainissant et purifiant de la peau. Ecorchures, petites blessures.', 72, 'https://www.boutika.co.ma/7512-home_default/ducray-diaseptyl-spray-125ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3125-ducray-diaseptyl-spray-125ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 48),
