(1707, 'LIRAC BODY-SLIM', '', 'LIRAC BODY-SLIM Concentré Minceur Globale 200ml Peau d’orange, perte de fermeté, excès de volume, BODY-SLIM est le premier soin minceur triple action qui corrige tous les signes visibles de la cellulite incrustée. Un complexe breveté à base de lotus sacré, de saule blanc et d’un peptide biotechnologique transforme les cellules responsables de l’aspect de...', 330, 'https://www.boutika.co.ma/6273-home_default/lirac-body-slim.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2648-lirac-body-slim.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1708, 'LIERAC Body Slim Ventre et Taille', '', 'LIERAC Body Slim Ventre et Taille 100ml BODY SLIM Ventre & taille concentré gainant anti-rondeurs Ce gel-crème fraîcheur cible spécifiquement les graisses abdominales pour un effet ventre plat, une taille affinée et une peau plus ferme. Dès 14 jours, les résultats sont visibles.', 330, 'https://www.boutika.co.ma/6277-home_default/lierac-body-slim-ventre-et-taille.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2650-lierac-body-slim-ventre-et-taille.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1709, 'LIERAC Body Slim Zones Rebelles', '', 'LIERAC Body Slim Zones Rebelles Ce sérum lifting assure un résultat anti-relâchement intensif de l’intérieur des bras et des cuisses et traque la cellulite rebelle avec un complexe exclusif pour une double action fermeté renforcée et anti-cellulite incrustée Dès 14 jours, les résultats sont visibles.', 320, 'https://www.boutika.co.ma/6281-home_default/lierac-body-slim-zones-rebelles.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2652-lierac-body-slim-zones-rebelles.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1710, 'LIERAC Morpho-Slim', '', 'LIERAC Morpho-Slim 100ml Morpho-Slim est un sérum-gel formulé sans alcool qui s\'adresse aux femmes les plus exigeantes en matière de lutte contre les problèmes de cellulite accompagnée de perte de fermeté.Ventre plat, taille affinée﻿', 299, 'https://www.boutika.co.ma/8319-home_default/lierac-morpho-slim.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3449-lierac-morpho-slim.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50);
