(1711, 'LIERAC Morpho-Slim Ventre et Taille', '', 'LIERAC Morpho-Slim Ventre Et Taille 100ml Concentré minceur fermeté. Formulé spécifiquement pour une action ciblée sur la ceinture abdominale, ce soin est enrichi en extrait d’algue brune pour lutter contre les rondeurs inesthétiques du ventre et de la taille.', 266, 'https://www.boutika.co.ma/8323-home_default/lierac-morpho-slim-ventre-et-taille.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3451-lierac-morpho-slim-ventre-et-taille.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1712, 'LIERAC Phytolastil Ampoules', '', 'LIERAC Phytolastil Ampoules 20 x 5ml Sérum correction des vergetures constituées﻿ Le Sérum Phytolastil Corps de Lierac est indiqué pour la correction des vergetures installées, il permet de les réduire en profondeur, en largeur, en longueur et atténue leur couleur.', 280, 'https://www.boutika.co.ma/8339-home_default/lierac-phytolastil-ampoules.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3460-lierac-phytolastil-ampoules.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1713, 'LIERAC Phytolastil Gel', '', 'LIERAC Phytolastil Gel 100ml Lierac Phytolastil Gel favorise la prévention et la régression des vergetures.', 154, 'https://www.boutika.co.ma/8346-home_default/lierac-phytolastil-gel.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3463-lierac-phytolastil-gel.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1714, 'LIERAC Phytolastil Soluté', '', 'LIERAC Phytolastil Soluté 75ml Sérum correction des vergetures constituées Ce sérum est formulé à base d\'une synergie végétale exclusive pour une réponse spécifique aux vergetures constituées.Puberté, Grossesse, Variations de Poids', 220, 'https://www.boutika.co.ma/8348-home_default/lierac-phytolastil-solute.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3464-lierac-phytolastil-solute.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1715, 'ELANCYL Prévention Vergetures 150ml', '', 'ELANCYL PREVENTION VERGETURES150ml﻿ Grâce à sa texture onctueuse, fondante et non grasse qui facilite l’application et permet une absorption immédiate, ce soin est un véritable moment de plaisir et de douceur au quotidien.﻿', 129, 'https://www.boutika.co.ma/11310-home_default/elancyl-prevention-vergetures-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4594-elancyl-prevention-vergetures-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1716, 'ELANCYL Activ massage minceur recharge 200ml', '', 'ELANCYL Activ massage minceur recharge 200ml﻿﻿ Le gel Activ\'Massage Elancyl est un gel de massage minceur pour la douche. Idéalement à utiliser avec un gant de massage, vous pouvez également l\'appliquer selon la méthode du \"palper-rouler\".Cette recharge de gel massage Activ\'Massage Minceur contient 200 ml.', 217, 'https://www.boutika.co.ma/11318-home_default/elancyl-activ-massage-minceur-recharge-200ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4598-elancyl-activ-massage-minceur-recharge-200ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1717, 'ELANCYL Activ massage minceur 200ml', '', 'ELANCYL Activ massage minceur 200ml﻿ Composé d\'un gant de massage et d\'un gel activ\' massage anti cellulite ce coffret de massage anti cellulite Elancyl est un produit complet pour le massage minceur. Il favorise le lissage des capitons et améliore le drainage des zones congestionnées.', 338, 'https://www.boutika.co.ma/11320-home_default/elancyl-activ-massage-minceur-200ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4599-elancyl-activ-massage-minceur-200ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1718, 'ELANCYL Cellu Reverse 100ml', '', 'ELANCYL Cellu Reverse 100ml﻿ Sérum minceur qui réactive et intensifie le mécanisme naturel de combustion de la cellulite. Une double action: -Action correctrice sur les graisses installées -Action préventive sur la capacité de stockage. Efficacité prouvée en 14 jours.﻿', 280, 'https://www.boutika.co.ma/11322-home_default/elancyl-cellu-reverse-100ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4600-elancyl-cellu-reverse-100ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1719, 'ELANCYL Cellu Reverse Duo 2*100ml.', '', 'ELANCYL Cellu Reverse Duo 2*100ml.﻿ La Nouvelle Technologie Minceur de Cellu/reverse 14 jours garantit une efficacité sur les signes visibles de la cellulite.Une double action:- Correctrice sur les graisses installées,- Préventive sur leur stockage futur.', 389, 'https://www.boutika.co.ma/11334-home_default/elancyl-cellu-reverse-duo-2100ml-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4604-elancyl-cellu-reverse-duo-2100ml-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1720, 'ELANCYL CELLU REVERSE SPECIAL VENTRE 75ml', '', 'ELANCYL CELLU REVERSE SPECIAL VENTRE 75ml﻿ Offre une triple action Minceur pour un effet optimal et ciblé sur la cellulite de la zone abdominale : 1) action anti-cellulite par réactivation de la lipo-combustion2) Fermeté renforcée3) Drainage stimulé Indications :Soin minceur sur la cellulite localisée zone abdominale.Adapté après une grossesse.', 207, 'https://www.boutika.co.ma/11346-home_default/elancyl-cellu-reverse-special-ventre-75ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4610-elancyl-cellu-reverse-special-ventre-75ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1721, 'ELANCYL DUO SPECIAL VENTRE 75ml', '', 'ELANCYL DUO SPECIAL VENTRE 2*75ML Descriptif : Offre une triple action Minceur pour un effet optimal et ciblé sur la cellulite de la zone abdominale :1) action anti-cellulite par réactivation de la lipo-combustion2) Fermeté renforcée3) Drainage stimulé Indications : Soin minceur sur la cellulite localisée zone abdominale.Adapté après une grossesse.', 310, 'https://www.boutika.co.ma/11351-home_default/elancyl-duo-special-ventre-75ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4612-elancyl-duo-special-ventre-75ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1722, 'ELANCYL FERMETÉ CORPS 250ml', '', 'ELANCYL FERMETÉ CORPS 250ml Lacrème fermeté corpsElancyl est unecrème raffermissanterecommandée pour raffermir et restaurer l\'élasticité de la peau.', 272, 'https://www.boutika.co.ma/11353-home_default/elancyl-fermete-corps.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4614-elancyl-fermete-corps.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1723, 'ELANCYL GEL DOUCHE TONIFIANT 250ml', '', 'LeGel Douche Elancylest unproduit pour la douche, conseillé pour nettoyer en douceur la peau tout en la tonifiant. Propriétés:Elancyl Gel Douche Tonifiantest composé d\'une formule sans savon à base de Lierre aux vertus drainantes et tonifiantes.Grâce à ce gel douche Elancyl, la peau est parfaitement nettoyée, fraiche, douce et plus tonique.', 97, 'https://www.boutika.co.ma/11359-home_default/elancyl-gel-douche-tonifiant-250ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4616-elancyl-gel-douche-tonifiant-250ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1724, 'ELANCYL PROMO LIPO REDUCTEUR 100ml', '', 'ELANCYL PROMO LIPO REDUCTEUR 100ml﻿ La texture gel du Concentré Lipo-réducteur respecte vos rythmes biologiques grâce à sa formule chronoprogrammée qui libère sélectivement ses actifs au moment où leur action sera la plus efficace. Efficace dès 14 jours, votre peau est lisse et plus ferme, l’aspect peau d’orange est considérablement atténué.', 296, 'https://www.boutika.co.ma/11373-home_default/elancyl-promo-lipo-reducteur-100ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4623-elancyl-promo-lipo-reducteur-100ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1725, 'ELANCYL REMODELANT BUSTE 50ml', '', 'ELANCYL REMODELANT BUSTE 50ml﻿ Le gel-crème Remodelant Buste resculpte, galbe et lisse la peau du cou, du décolleté et des seins. Ce soin associe des actifs raffermissants et antioxydants pour restructurer l’élasticité et la fermeté de la peau. Lissée et nourrie, elle assure à nouveau son rôle de maintien naturel. Resculpté et galbé, l’aspect du buste...', 256, 'https://www.boutika.co.ma/11377-home_default/elancyl-remodelant-buste-50ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4625-elancyl-remodelant-buste-50ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
(1726, 'ELANCYL SPECIFIC VERGETURES 150ml', '', 'ELANCYL SPECIFIC VERGETURES 150ml﻿ Très riche en huile de Carthame et en extraits nutritifs d\'origine marine, ce soin nourrit intensément l\'épiderme et assouplit votre peau, augmentant ainsi sa résistance aux distensions. Onctueuse et légère à la fois, cette crème s’étale facilement, ne colle pas et permet de s’habiller rapidement après l’application.', 134, 'https://www.boutika.co.ma/11381-home_default/elancyl-specific-vergetures-150ml-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/4627-elancyl-specific-vergetures-150ml-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 50),
