(1774, 'LA ROCHE POSAY Toleriane Teint Mineral N11', '', 'LA ROCHE POSAY Toleriane Teint Mineral N11 Tolériane Teint Minéral permet de corriger et d\'effacer les imperfections des peaux normales à mixtes sensibles à intolérantes.', 180, 'https://www.boutika.co.ma/7964-home_default/la-roche-posay-toleriane-teint-mineral-n11.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3308-la-roche-posay-toleriane-teint-mineral-n11.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 52),
