(2121, 'BOSCH Buse d\'aspiration pour nettoyeur à...', '', 'Embout suceur pour nettoyeur haute pression Bosch Aquatak', 289, 'https://www.boutika.co.ma/27721-home_default/bosch-buse-d-aspiration-pour-nettoyeur-a-haute-pression-aquatak.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10159-bosch-buse-d-aspiration-pour-nettoyeur-a-haute-pression-aquatak.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 59),
