(2125, 'BOSCH Flexible de nettoyage des conduits', '', 'Déboucheur de canalisation 10 m, adapté au nettoyeur à haute pression Bosch Aquatak', 299, 'https://www.boutika.co.ma/27796-home_default/bosch-flexible-de-nettoyage-des-conduits.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10187-bosch-flexible-de-nettoyage-des-conduits.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 59),
