(2133, 'BOSCH Découpeur universel sans fil XEO II', '', 'Le découpeur universel sans fil compact Xeo : une capacité de coupe supérieure de 30 % Système CutControl pour un guidage de coupe précis Batterie Lithium-Ion : absence d\'effet mémoire et d\'autodécharge, disponibilité permanente Avec indication de l\'état et du niveau de charge de la batterie Forme compacte pour une parfaite maniabilité Coupe sans peine...', 599, 'https://www.boutika.co.ma/27137-home_default/bosch-decoupeur-universel-sans-fil-xeo.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10003-bosch-decoupeur-universel-sans-fil-xeo.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 59);
