(2211, 'Amlou Aux Amandes +Miel 250g', '', 'Amlou Aux Amandes +Miel 250gBIO ARDO MAROC Cette recette est faite de l\'huile d\'argan, de miel et d\'amandes , c\'est typiquement marocain puisque l\'arganier ( l\'arbre qui produit de l\'argan ) se trouve seulement au Maroc et nul part ailleurs dans le monde.', 115, 'https://www.boutika.co.ma/8464-home_default/amlou-aux-amandes-miel-1kg.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3522-amlou-aux-amandes-miel-1kg.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60),
(2212, 'ORIPERLE Gommage Ava Care', '', 'AVA care contient une formule renforcéeenrichie avec des agents exfoliants et unmélange de constituants aidant à garder unepeau saine et claire avec une apparence plusjeune. Virtues | Benefits Formule renforcéeDouceur au toucher Beauté impressionnantePoids Net: 50 gram', 81, 'https://www.boutika.co.ma/27556-home_default/oriperle-gommage-ava-care.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10099-oriperle-gommage-ava-care.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60),
(2213, 'Jus de Dattes 500ml (Lot 2 Pièces)', '', 'Jus de Dattes 500ml X 2BIO ARDO MAROC Une bonne boisson pour une vie en bonne santé ! C\'est la plus salubre et délicieuse des boissons, un combustible puissant qui fournit l\'énergie au muscle et un goût unique qu’il apporte aux recettes qui en contiennent. Sans ajout de sucre, colorant ni conservateur', 160, 'https://www.boutika.co.ma/8466-home_default/jus-de-dattes-500ml.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3523-jus-de-dattes-500ml.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60),
(2214, 'Huile essentielle d’Eucalyptus Citronnée', '', 'Aide à apaiser l\'inflammation naturellement Huile chauffante utile pour les maux musculaires Cicatrisante du premier choix Aide à baisser la température du corps  L’huile essentielle d’Eucalyptus ORIPERLE est une excellente huile de massage recommandée pour les douleurs musculaires.Elle aide à réduire l\'apparence des cicatrices superficielles. Elle est...', 161, 'https://www.boutika.co.ma/27795-home_default/huile-essentielle-deucalyptus-citronnee.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10186-huile-essentielle-deucalyptus-citronnee.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60),
(2215, 'Huile D’olive Naturelle 5L', '', 'Huile D’olive Naturelle 5L BIO ARDO MAROC L’huile d’olive peut être utilisée aussi bien crue (dans des sauces pour salade ou à la place du beurre dans les pâtes par exemple) que cuite (pour la cuisson de viandes ou de légumes ou pour la friture).', 265, 'https://www.boutika.co.ma/8470-home_default/huile-dolive-naturelle-5l.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3525-huile-dolive-naturelle-5l.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60),
(2216, 'Avoine 500g (Lot 2 Pièces)', '', 'Avoine 500gX 2BIO ARDO MAROC L\'avoine ont des effets sur le cholestérol, la nervosité, l’insomnie et l\'hypertension , elle est excellente pour les problèmes de peau : acné et irritations cutanées notamment. Source de fer, de magnésium et de phosphore, elle est à redécouvrir. Une plante aux mille vertus.', 99, 'https://www.boutika.co.ma/8476-home_default/avoine-500g.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3528-avoine-500g.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60),
(2217, 'Millet 500g (Lot 2 Pièces)', '', 'Millet 500gX 2BIO ARDO MAROC Le millet est une graminèe à très petites graines . Ce sont des cèrèales cultivèes principalement dans les zones sèches (comme en Afrique) car elles sont très rèsistantes à la chaleur.Le millet (comme l\'avoine), est une céréale à haute valeur nutritionnelle, car elle est riche en corps gras et en protéines.', 99, 'https://www.boutika.co.ma/8478-home_default/millet-500g.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3529-millet-500g.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60),
(2218, 'Soja 500g (Lot 2 Pièces)', '', 'Soja 500g X 2 BIO ARDO MAROC Le soja est tres bon pour la santé. Il aurait des vertus lors de la ménopause, contre le surpoids, l’ostéoporose.', 99, 'https://www.boutika.co.ma/8480-home_default/soja-500gsoja-500g.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3530-soja-500gsoja-500g.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60),
(2219, 'Jujubier 500g (Lot 2 Pièces)', '', 'Jujubier 500gX 2BIO ARDO MAROC Le fruit du jujubier est connu pour contenir des principes actifs anti-inflammatoires et anti-microbiens. Il agit donc favorablement contre la toux et les infections des voies respiratoires. Il est aussi utilisé pour soigner les diarrhées grâce ses propriétés astringentes et aide à faire baisser la fièvre. L\'huile de...', 99, 'https://www.boutika.co.ma/8482-home_default/jujubier-500g.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3531-jujubier-500g.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60),
(2220, 'Caroube 500g (Lot 2 Pièces)', '', 'Caroube 500gX 2BIO ARDO MAROC Riche en oligo-aliments, le Caroube a pour effet de désintoxiquer le corps et participe au bon fonctionnement du système immunitaire.', 99, 'https://www.boutika.co.ma/8484-home_default/caroube-500g.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3532-caroube-500g.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60),
(2221, 'Huile D’argan Pure Alimentaire 1L', '', 'Huile D’argan Alimentaire 1L BIO ARDO MAROC Ses propriétés organoleptiques en font une huile précieuse pour l\'art culinaire. Son goût d\'amande et de noisette (dû à une légère torréfaction qui lui donne aussi sa couleur plus foncée) rehausse la saveur des plats, comme le couscous, les poissons et les vinaigrettes.', 295, 'https://www.boutika.co.ma/8492-home_default/huile-dargan-alimentaire-1l.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3536-huile-dargan-alimentaire-1l.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 60);
