(2229, 'PHYTOCYANE SHP', '', 'PHYTOCYANE SHP 200ml Complète et optimise l\'action du sérum, le shampooing Phytocyane fortifie les cheveux et apporte une réponse anti-âge.La chevelure est densifiée et brillante.', 87, 'https://www.boutika.co.ma/6358-home_default/phytocyane-shp.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2681-phytocyane-shp.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 61),
(2230, 'PHYTODENSIUM SHP', '', 'PHYTODENSIUM SHP 200ml La gatuline âge-défense, issue d\'une extraction sélective de noix aux propriétés anti-radicalaires, prévient et lutte contre le vieillissement. Protégés et tonifiés, les cheveux retrouvent densité et vitalité.', 100, 'https://www.boutika.co.ma/6377-home_default/phytodensium-shp.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2688-phytodensium-shp.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 61),
(2231, 'PHYTOJOBA SHP', '', 'PHYTOJOBA SHP 200ml Spécifiquement formulé pour les cheveux secs, Phytojoba est un shampooing doux et onctueux, hautement hydratant, qui renforce la protection naturelle du cheveu et préserve son intégrité.', 87, 'https://www.boutika.co.ma/6399-home_default/phytojoba-shp-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2698-phytojoba-shp-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 61),
(2232, 'PHYTOKERATINE MASQUE', '', 'PHYTOKERATINE MASQUE POT 200ml Ce masque fondant PHYTOKERATINE restitue matière, force et brillance aux cheveux les plus abîmés. Rechargés, les cheveux sont plus résistants, souples et soyeux.', 220, 'https://www.boutika.co.ma/6403-home_default/phytokeratine-masque-pot.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2700-phytokeratine-masque-pot.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 61),
(2233, 'PHYTOKERATINE Sérum Réparateur', '', 'PHYTOKERATINE Sérum RéparateurToute la force de la kératine végétale pour réparer vos cheveux abîmés. Le sérum PHYTOKÉRATINE a été spécifiquement formulé pour réparer les longueurs et les pointes abîmées. Les pointes sont réparées aussi douces que la soie.', 240, 'https://www.boutika.co.ma/6408-home_default/phytokeratine-serum-reparateur-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2703-phytokeratine-serum-reparateur-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 61),
(2234, 'PHYTOKERATINE SPRAY', '', 'PHYTOKERATINE SPRAY 150ml A chaque brushing, les cheveux retrouvent force et soyeux jusqu’aux pointes, et le brushing devient un geste de soin! PHYTOKERATINE répare efficacement la matière interne des cheveux abîmés tout en les protégeant de la chaleur et de la casse pendant les brushings.', 134, 'https://www.boutika.co.ma/6428-home_default/phytokeratine-spray-.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/2712-phytokeratine-spray-.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 61),
