(2237, 'SVR Provegol Shampooing Extra Doux', '', 'SVR Provegol Shampooing Extra Doux 200ml Shampooing usage fréquent, convient à tous les types de cheveux et est recommandé en relais des shampooings traitants.', 94, 'https://www.boutika.co.ma/7739-home_default/svr-provegol-shampooing-extra-doux.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/3213-svr-provegol-shampooing-extra-doux.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 61),
