(2281, 'ORIPERLE Huile de Coco', '', 'L’huile de Coco ORIPERLE se caractérise par êtreémolliente, adoucissante hydratante etrafraîchissante.Elle assouplit les zones sèches et sensibles ducorps avec un effet rafraîchissant sur la peau.Elle aide aussi à se débarrasser des cellulesmortes en l’utilisant comme massage pour le corps.VOL : 50 ml | 1.7 fl oz', 100, 'https://www.boutika.co.ma/27511-home_default/oriperle-huile-de-coco.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10083-oriperle-huile-de-coco.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 61),
(2282, 'ORIPERLE Huile de Fenugrec', '', 'L’huile de Fenugrec ORIPERLE est recommandéesurtout en cas de chute des cheveux, comme elleest un très bon traitement en cas des cheveux secs, cassants et fragile.Grâce à la présence des vitamines A, B1, B2, B3, B5et D, l’huile de Fenugrec ORIPERLE fortifie etadoucit vos cheveux en les laissant brillants et enpleine vitalité.VOL : 50 ml | 1.7 fl oz', 105, 'https://www.boutika.co.ma/27514-home_default/oriperle-huile-de-fenugrec.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10084-oriperle-huile-de-fenugrec.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 61),
(2283, 'ORIPERLE Huile de Ricin', '', 'L’huile de Ricin ORIPERLE est un traitementpolyvalent parfait; elle stimule la repousse descheveux, renforce les cils, traite les ongles fragileset vous pouvez l’utiliser comme baume à lèvreadoucissant pour protéger vos lèvres.VOL : 50 ml | 1.7 fl oz', 105, 'https://www.boutika.co.ma/27519-home_default/oriperle-huile-de-ricin.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10086-oriperle-huile-de-ricin.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 61),
