(2640, 'GoPro Fixation bracelet', '', 'GoPro Fixation bracelet Portez votre GoPro au poignet comme une montre. Compatibilité : HERO4 Black, HERO4 Silver, HERO3+ and HERO3. Maintient votre caméra à plat sur votre poignet pour un confort mains libres.', 599, 'https://www.boutika.co.ma/22213-home_default/gopro-fixation-bracelet.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8229-gopro-fixation-bracelet.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 72),
