(2646, 'GoPro Double Chargeur de Batterie (Hero 4)', '', 'GoPro Double Chargeur de Batterie (Hero 4) Rechargez deux batteries de caméras HERO4 simultanément. Compatibilité : HERO4 Black, HERO4 Silver + 1 Batterie', 699, 'https://www.boutika.co.ma/22193-home_default/gopro-double-chargeur-de-batterie-hero-4.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8222-gopro-double-chargeur-de-batterie-hero-4.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 72),
