(2651, 'GoPro Flotteur Hero 4 Session', '', 'GoPro Flotteur Hero 4 Session - Facile à repérer, ce flotteur se place autour de votre HERO4 Session pour l\'empêcher de couler Un rembourrage moelleux protège votre caméra Idéal pour la plongée en apnée, le surf, le wakeboard ou toute autre activité nautique.', 279, 'https://www.boutika.co.ma/22216-home_default/gopro-flotteur-hero-4-session.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8230-gopro-flotteur-hero-4-session.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 72),
