(2654, 'GoPro Harnais de fixation Poitrine GoPro -...', '', 'GoPro Harnais de fixation Poitrine GoPro - Chesty Offre une perspective ultra immersive Parfait pour le ski, le vélo, le motocross ou les sports de pagaie Entièrement réglable, il s\'adapte à différentes tailles adultes.', 499, 'https://www.boutika.co.ma/22228-home_default/gopro-harnais-de-fixation-poitrine-gopro-chesty.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8234-gopro-harnais-de-fixation-poitrine-gopro-chesty.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 72),
(2655, 'La courroie GoPro', '', 'Attachez votre GoPro à votre main, poignet, bras ou jambe pour créer d\'incroyables vidéos en POV, des selfies et plus encore.Compatibilité: toutes les caméras GoPro', 749, 'https://www.boutika.co.ma/23093-home_default/la-courroie-gopro.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8460-la-courroie-gopro.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 72),
