(2662, 'Attaches de l\'appareil photo GoPro', '', 'Sécurisez votre GoPro dans des conditions extrêmes avec ces attaches.Compatibilité: Toutes les caméras GoPro', 279, 'https://www.boutika.co.ma/23117-home_default/attaches-de-l-appareil-photo-gopro.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8472-attaches-de-l-appareil-photo-gopro.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 72),
