(2664, 'Trousse (Camera + Montures + Etui)', '', 'Protégez vos caméras HERO, ainsi que les montures et les accessoires nécessaires.Compatibilité: All GoPro caméras, supports et accessoires', 679, 'https://www.boutika.co.ma/23121-home_default/trousse-camera-montures-etui.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8475-trousse-camera-montures-etui.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 72),
(2665, 'ENVIE ECR-6 Chargeur Batterie Nano', '', 'Recharge batteries en 3 heures. Prend en charge une plage de tension entre 100-240V. Option parfaite pour recharger vos batteries efficacement 2xAA 2100mAH', 129, 'https://www.boutika.co.ma/23746-home_default/envie-ecr-6-chargeur-batterie-nano-avec-2xaa-2100mah.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/8685-envie-ecr-6-chargeur-batterie-nano-avec-2xaa-2100mah.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 72),
(2666, 'ADATA MICRO SD CARD 64 GB AVEC ADAPTATEUR...', '', 'Carte mémoire flash - 64 Go Vitesse de lecture : Jusqu\'à 30 Mo-s Vitesse d\'écriture : Jusqu\'à 10 Mo-s microSDXC UHS-I Memory Card Antichoc, résistant aux champs magnétiques, Etanche, prise en charge ECC (Error Correcting Code), commutateur de protection d\'écriture, résistant aux rayons X', 524, 'https://www.boutika.co.ma/27688-home_default/adata-micro-sd-card-64-gb-avec-adaptateur-class-10.jpg', '', 'https://www.boutika.co.ma/', 'https://www.boutika.co.ma/10143-adata-micro-sd-card-64-gb-avec-adaptateur-class-10.html', 'http://137.74.199.121/img/logo/ma/boutika.jpg', 0, 72);
